INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('AFG','Afghanistan is a mountainous country located at the crossroads of Central and South Asia, known for its rich history as part of the Silk Road trade route. It has diverse ethnic groups and cultures, with stunning landscapes ranging from rugged mountains to arid deserts. Despite ongoing challenges, Afghanistan''s cultural heritage remains vibrant. Afghanistan is a mountainous country located at the crossroads of Central and South Asia, known for its rich history as part of the Silk Road trade route. It has diverse ethnic groups and cultures, with stunning landscapes ranging from rugged mountains to arid deserts. Despite ongoing challenges, Afghanistan''s cultural heritage remains vibrant.','Developing-Nation Public Systems with Aid Support - These systems provide basic care, maternal and child health, and rely heavily on international aid and NGOs. Coverage and quality vary greatly, with significant disparities between urban centers and rural zones.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ALB','Albania, located on the Balkan Peninsula, boasts a rugged landscape with mountains, beautiful beaches along the Adriatic and Ionian Seas, and a rich mix of historical influences from Illyrian, Roman, Byzantine, and Ottoman eras. It’s known for its hospitality and unique culture that has remained relatively isolated. Fun fact: Albania is home to butrint, an ancient UNESCO World Heritage site with ruins dating back to Greek and Roman times.','Albania has a publicly funded healthcare system based on compulsory health insurance, managed by the Health Insurance Institute. Primary healthcare is widely accessible, and citizens contribute through payroll taxes. However, quality and access can be uneven, especially in rural areas, and patients often pay out-of-pocket for medication or private services. The country has been working on reforms to modernize facilities and reduce informal payments.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('DZA','Algeria is a country located in the Africa region. It is the largest country on the African continent by land area and features vast stretches of the Sahara Desert. The country has a rich history influenced by Berber, Arab, Ottoman, and French cultures. Fun fact: Algeria’s Sahara region is home to some of the most stunning desert landscapes and ancient rock art sites.','Algeria provides free universal healthcare, funded by the government through oil and gas revenues. The public system covers all citizens and residents, offering services at hospitals and clinics. While access is generally good, the quality of care varies significantly between urban and rural areas. Private clinics are available for those who can afford them and often offer faster or more advanced services.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('AND','Nestled in the Pyrenees mountains between France and Spain, Andorra is famous for its ski resorts, duty-free shopping, and scenic beauty. It is one of the smallest countries in Europe but enjoys high standards of living and a strong tourism industry. Fun fact: Andorra has no airports or railways; most visitors arrive by road!','Small-State & Low-Resource Variants - often reliant on public-private partnerships or external support. Andorra uses a mandatory health insurance fund for all residents.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('AGO','Angola is a country located in the Africa region. It has a diverse terrain that includes tropical Atlantic beaches, a labyrinthine system of rivers, and Sub-Saharan desert regions. Since the end of its civil war in 2002, Angola has been working to rebuild its infrastructure and economy. Fun fact: Angola has one of the youngest populations in the world, with a median age of just about 16 years.','Developing-Nation Public Systems with Aid Support - These systems provide basic care, maternal and child health, and rely heavily on international aid and NGOs. Coverage and quality vary greatly, with significant disparities between urban centers and rural zones.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ATG','Antigua and Barbuda is a twin-island nation in the Caribbean known for its stunning beaches, coral reefs, and vibrant culture. Antigua’s 365 beaches—one for each day of the year—are a major draw for tourists. The islands celebrate a rich heritage with colorful festivals and music. Fun fact: Antigua’s English Harbour is famous for its annual sailing regatta, attracting sailors worldwide.','This twin-island nation offers public healthcare funded by the government, including a national health insurance scheme. Public hospitals and clinics offer basic care, though more complex procedures may require treatment abroad. Private facilities also operate and are often used by wealthier residents or visitors.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ARG','Argentina is famous for its diverse landscapes, from the glaciers of Patagonia to the vibrant city life of Buenos Aires. It’s the birthplace of tango music and dance and boasts rich culinary traditions like asado (barbecue). Argentina is also home to the stunning Iguazu Falls on its northern border. Fun fact: Argentina was the first country to use fingerprinting as a method of identification in 1892.','Mixed Public-Private Models with Universal Coverage - these countries combine government-funded services with private options. Argentina offers layered approaches - public systems serve the uninsured, while formal-sector or private insurance caters to others.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ARM','Armenia, in the South Caucasus region, is known as the world’s first Christian nation, adopting Christianity as a state religion in 301 AD. Its ancient monasteries and rugged terrain highlight its deep cultural heritage. Despite its small size, Armenia has a rich tradition in art, music, and literature. Fun fact: Armenia is home to Mount Ararat, a national symbol that is traditionally considered the resting place of Noah’s Ark.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: public coverage is strong and expanding, with private sectors catering to those seeking faster access or specialist services.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('AUS','Australia is a vast country and continent known for its unique wildlife, such as kangaroos and koalas, and natural wonders like the Great Barrier Reef, the world’s largest coral reef system. Its cities like Sydney and Melbourne offer a mix of vibrant urban life and outdoor adventures. Fun fact: Australia is home to the world’s longest fence, built to keep dingoes away from fertile land.','National Health Service / Social Insurance Systems - these countries offer universal coverage funded through taxation or mandatory insurance contributions. Australia’s Medicare covers public hospital care and subsidized outpatient services nationwide.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('AUT','Austria is a landlocked Alpine country renowned for its musical legacy, with famous composers like Mozart and Beethoven hailing from there. The capital, Vienna, is known for its classical music scene, imperial architecture, and vibrant coffeehouse culture. Fun fact: Austria hosts the world’s oldest zoo, Tiergarten Schönbrunn, founded in 1752.','National Health Service / Social Insurance Systems - these countries offer universal coverage funded through taxation or mandatory insurance contributions. Austria uses compulsory health insurance with competing public insurers, ensuring comprehensive care.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('AZE','Azerbaijan lies at the crossroads of Eastern Europe and Western Asia, with diverse landscapes ranging from the Caspian Sea coast to mountainous regions. It’s known for its rich oil reserves, ancient heritage sites, and the modern, futuristic architecture of Baku. Fun fact: Azerbaijan is known as the "Land of Fire" due to natural gas flames that have been burning for centuries in places like Yanar Dag.','Mixed Public-Private Models with Universal Coverage - these countries offer basic public coverage alongside private options: public systems provide core services with expanding insurance, while private clinics offer speed and luxury.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BHS','The Bahamas is an archipelago of over 700 islands and cays known for crystal-clear waters, pink sand beaches, and vibrant marine life. Nassau, the capital, mixes colonial architecture with bustling markets. The Bahamas is a popular destination for snorkeling and diving. Fun fact: The Bahamas is home to the world’s third-largest barrier reef.','Small-State & Low-Resource Variants - often reliant on public-private partnerships or external support. Many Caribbean territories offer publicly funded primary care, often supplemented by private facilities or overseas referrals for complex treatments.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BHR','Bahrain is a small island nation in the Persian Gulf known for its rich history as a trading hub and its modern economy based on banking and petroleum. It’s famous for the ancient Dilmun civilization and modern landmarks like the Bahrain World Trade Center. Fun fact: Bahrain hosts one of the Middle East’s oldest pearl diving industries, historically making it a center for natural pearls.','Bahrain has a dual public-private healthcare system, with free or subsidized public care for citizens and mandatory insurance for foreign workers. Public hospitals are run by the Ministry of Health, and recent reforms are introducing a national health insurance program. The private sector is also well-developed, and medical tourism is a growing sector.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BGD','Bangladesh, located on the Bay of Bengal, is known for its lush greenery and many waterways. It’s one of the most densely populated countries, with a rich tradition in textiles and a booming garment industry. The Sundarbans mangrove forest, home to the Bengal tiger, is a UNESCO World Heritage Site here. Fun fact: The Sundarbans in Bangladesh is the largest mangrove forest in the world and a critical habitat for the endangered Royal Bengal Tiger.','Bangladesh provides government-subsidized healthcare, but out-of-pocket expenses remain high. Public facilities offer services, but quality and availability are inconsistent, particularly in rural areas. There is no universal insurance system, and private providers dominate urban healthcare. Recent efforts focus on increasing maternal and child healthcare coverage and digital health access.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BRB','Barbados is a Caribbean island known for its friendly culture, beautiful beaches, and rich history influenced by British colonialism. The island’s crop over festival is a lively celebration of Barbadian heritage. Barbados is also famous for rum production. Fun fact: Barbados is home to Harrison’s Cave, a spectacular limestone cave with streams and waterfalls.','Small-State & Low-Resource Variants - often reliant on public-private partnerships or external support. Many Caribbean territories offer publicly funded primary care, often supplemented by private facilities or overseas referrals for complex treatments.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BLR','Belarus is a landlocked country in Eastern Europe, known for its vast forests, lakes, and Soviet-era architecture. Minsk, the capital, is a cultural and industrial hub. The country has a rich tradition of folk music and arts despite its political isolation in recent decades. Fun fact: Belarus has one of the largest preserved primeval forests in Europe, the Białowieża Forest, shared with Poland.','Belarus has a state-run, tax-funded healthcare system, offering universal coverage. Services are largely free at the point of delivery, and the country maintains a dense network of hospitals and clinics. However, underfunding and outdated infrastructure persist, and patients sometimes resort to informal payments or private clinics for better service.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BEL','Belgium is famous for its medieval towns, Renaissance architecture, and as the headquarters of the European Union and NATO. It’s renowned worldwide for its chocolates, waffles, and beer. The country’s multilingual population speaks Dutch, French, and German. Fun fact: Belgium produces more than 2200 different kinds of beer, more than any other country in the world.','National Health Service / Social Insurance Systems - these countries offer universal coverage funded through taxation or mandatory insurance contributions.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BLZ','Belize is a small Central American country with Caribbean shores, famous for its rich biodiversity and the Belize Barrier Reef, the second-largest coral reef system in the world. It has a diverse population with Mayan, Creole, and Garifuna influences. Fun fact: Belize is home to the Great Blue Hole, a giant marine sinkhole and popular diving spot.','Belize operates a dual healthcare system, with free or low-cost services at public clinics and hospitals, and fee-based care in private facilities. The National Health Insurance (NHI) system covers certain districts and aims to expand. Challenges include resource limitations and healthcare access in remote areas.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BEN','Benin is a country located in the Africa region. Situated in West Africa, it has a long coastline along the Bight of Benin and a history as part of the powerful Dahomey Kingdom. The country is a multi-ethnic society with vibrant traditions and music. Fun fact: Benin is considered the birthplace of the Vodun (Voodoo) religion, which remains widely practiced.','Developing-Nation Public Systems with Aid Support - These systems provide basic care, maternal and child health, and rely heavily on international aid and NGOs. Coverage and quality vary greatly, with significant disparities between urban centers and rural zones.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BTN','Bhutan is a Himalayan kingdom famous for its stunning mountain landscapes, unique Buddhist culture, and commitment to Gross National Happiness over GDP. Visitors often seek its peaceful monasteries, festivals, and breathtaking trekking routes. Fun fact: Bhutan measures success by Gross National Happiness, prioritizing well-being and sustainability rather than purely economic growth.','Bhutan provides free universal healthcare, guided by its Gross National Happiness philosophy. The government funds all public health services, including traditional medicine. Healthcare delivery is strong at the primary level, but more specialized care often requires referral abroad due to limited tertiary infrastructure.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BOL','Bolivia is known for its high-altitude cities like La Paz and the vast salt flats of Salar de Uyuni, the world’s largest salt flat. The country has a rich indigenous culture with many Quechua and Aymara people preserving their traditions and languages. Fun fact: Bolivia has two capitals: Sucre (constitutional capital) and La Paz (administrative capital).','Bolivia recently introduced universal healthcare (SUS - Sistema Único de Salud) for all citizens without private insurance. Services are delivered through public hospitals and clinics, though capacity and supply issues remain. Private care is also available, and disparities in healthcare quality persist between urban and rural populations.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BIH','Bosnia and Herzegovina features a diverse cultural heritage influenced by Ottoman, Austro-Hungarian, and Slavic traditions. Its landscapes range from rugged mountains to picturesque rivers and historic towns like Sarajevo and Mostar, famous for the iconic Stari Most bridge. Fun fact: Sarajevo hosted the 1984 Winter Olympics, making it one of the few cities to host both Summer and Winter Olympic events nearby.','The country has a highly decentralized health system, with separate entities (Federation of BiH, Republika Srpska, and Brčko District) managing their own healthcare services. Public health insurance is mandatory, covering a large portion of the population, but the quality and efficiency vary. Private services are growing but remain limited.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BWA','Botswana is a country located in the Africa region. Known for its political stability and diamond industry, Botswana is also one of Africa’s success stories in terms of development and conservation. Fun fact: It is home to the Okavango Delta, one of the world’s largest inland deltas and a UNESCO World Heritage Site.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: public systems with rising national insurance schemes, often supplemented by private providers.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BRA','Brazil is the largest country in South America and home to the Amazon Rainforest, the world’s largest tropical rainforest. Rio de Janeiro’s Carnival is one of the biggest and most colorful festivals globally. Brazil’s rich cultural heritage blends indigenous, African, and Portuguese influences. Fun fact: Brazil is the world’s largest producer of coffee, responsible for about a third of global production.','Mixed Public-Private Models with Universal Coverage - these countries combine government-funded services with private options. Brazil’s SUS delivers universal coverage alongside thriving private clinics and insurance for those who can pay.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BRN','Brunei is a wealthy, small nation on the island of Borneo, rich in oil and natural gas. It is ruled by a Sultan and is known for its grand mosques, pristine rainforests, and high standard of living. The country is a peaceful, Islamic monarchy with a focus on conservation. Fun fact: Brunei has one of the highest standards of living in Asia and offers free education and healthcare to its citizens.','Brunei offers free, high-quality healthcare to citizens, fully funded by oil revenues. The Ministry of Health operates a well-developed network of hospitals and clinics. Foreigners must pay for services or carry insurance. The country is recognized for its strong primary healthcare and low infant mortality rates.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BGR','Bulgaria is a Balkan country with a rich history dating back to ancient Thracians and the medieval Bulgarian Empire. It features diverse landscapes including mountains, plains, and a beautiful Black Sea coastline. Sofia, the capital, blends Roman ruins with modern life, and Bulgarian folklore is strong in traditions and festivals. Fun fact: Bulgaria is the birthplace of the Cyrillic alphabet, which is used in many Slavic countries today.','Bulgaria runs a universal healthcare system funded through mandatory health insurance contributions managed by the National Health Insurance Fund. All residents must enroll and contribute, with exemptions for vulnerable groups. While public care is available, the private sector is expanding, and under-the-table payments still exist in some areas.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BFA','Burkina Faso is a landlocked country located in the Africa region. It has a rich culture with many languages spoken and traditional art forms practiced. The name "Burkina Faso" means "Land of Upright People" in local languages. Fun fact: Despite being landlocked, it has a vibrant musical tradition known across Africa for its rhythms and instruments.','Developing-Nation Public Systems with Aid Support - These systems provide basic care, maternal and child health, and rely heavily on international aid and NGOs. Coverage and quality vary greatly, with significant disparities between urban centers and rural zones.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('BDI','Burundi is a small, landlocked country located in the Africa region. It has a long history of kingdoms and colonial rule, gaining independence in 1962. The country is rich in cultural traditions and scenic hills. Fun fact: Burundi is one of the most densely populated countries in Africa, despite its relatively small size.','Developing-Nation Public Systems with Aid Support - These systems provide basic care, maternal and child health, and rely heavily on international aid and NGOs. Coverage and quality vary greatly, with significant disparities between urban centers and rural zones.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('KHM','Cambodia is known for its extraordinary Angkor Wat temple complex, a UNESCO World Heritage site and the largest religious monument in the world. The country has a tragic history with the Khmer Rouge regime, but today it’s a resilient nation that continues to attract visitors with its warm people and rich heritage. Fun fact: Angkor Wat is featured on Cambodia’s national flag — one of the only national flags in the world to feature a building.','Developing-Nation Public Systems with Aid Support - These systems provide basic care, maternal and child health, and rely heavily on international aid and NGOs. Coverage and quality vary greatly, with significant disparities between urban centers and rural zones.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('CMR','Cameroon is a country located in the Africa region, often described as "Africa in miniature" due to its diverse geography, languages, and cultures. It features everything from beaches to rainforests to mountains. Fun fact: Cameroon is one of the few countries in the world where both French and English are official languages.','Cameroon has a mixed healthcare system consisting of public, private, and faith-based facilities. The government provides subsidized care, but most people pay out-of-pocket, as there is no universal health insurance system. Rural areas suffer from poor infrastructure and understaffing, and access to care is limited. Maternal and child health services have improved in recent years, but the country still faces significant public health challenges like malaria and HIV.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('CAN','Canada is the world’s second-largest country by land area, known for its vast wilderness, multicultural cities, and friendly people. From the Rocky Mountains to Niagara Falls, Canada offers stunning landscapes and outdoor adventures. It has two official languages: English and French. Fun fact: Canada has more lakes than any other country, containing about 20% of the world’s freshwater.','National Health Service / Social Insurance Systems - these countries offer universal coverage funded through taxation or mandatory insurance contributions. Canada''s single-payer model operates mainly at the provincial level, offering hospital and physician services free at the point of delivery.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('CPV','Cape Verde is an island country located off the west coast of Africa in the Atlantic Ocean. It consists of 10 volcanic islands and is known for its Creole Portuguese-African culture. Fun fact: The country is famous for its traditional morna music, popularized by singer Cesária Évora.','Developing-Nation Public Systems with Aid Support - These systems provide basic care, maternal and child health, and rely heavily on international aid and NGOs. Coverage and quality vary greatly, with significant disparities between urban centers and rural zones.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('CAF','The Central African Republic is a landlocked country in the heart of Africa. It is rich in resources like diamonds, gold, and uranium but has faced significant political instability. Fun fact: Despite being sparsely populated, it is home to Dzanga-Sangha National Park, which shelters rare forest elephants and western lowland gorillas.','Developing-Nation Public Systems with Aid Support - These systems provide basic care, maternal and child health, and rely heavily on international aid and NGOs. Coverage and quality vary greatly, with significant disparities between urban centers and rural zones.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('TCD','Chad is a country located in the Africa region, characterized by desert in the north, arid Sahelian belt in the center, and savanna in the south. It''s culturally diverse with over 100 languages spoken. Fun fact: Chad is home to Lake Chad, once one of Africa’s largest lakes, which has dramatically shrunk in recent decades due to climate change and human use.','Developing-Nation Public Systems with Aid Support - These systems provide basic care, maternal and child health, and rely heavily on international aid and NGOs. Coverage and quality vary greatly, with significant disparities between urban centers and rural zones.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('CHL','Chile stretches along South America’s western edge with the Pacific Ocean to the west and the Andes mountains to the east. It is known for its deserts in the north, such as the Atacama Desert, and glaciers in the south. Santiago, its capital, is a vibrant cultural hub. Fun fact: The Atacama Desert in Chile is one of the driest places on Earth.','Chile has a dual public-private system, offering universal healthcare through FONASA, the public insurer, while private care is available via ISAPREs for those who can afford it. The public sector provides basic to advanced services, although wait times can be long. The country is recognized for its effective primary care network and investment in preventive services.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('CHI','China is the most populous country in the world and has one of the oldest continuous civilizations, dating back over 4,000 years. Known for the Great Wall, the Terracotta Army, and its rapid modernization, China plays a major role in global economics and culture. Fun fact: The Great Wall of China stretches over 21,000 kilometers and is the longest structure ever built by humans.','Mixed Public-Private Models with Universal Coverage - these countries combine government-funded services with private options. China’s evolving insurance schemes aim to cover nearly 95% of citizens, but quality varies across urban and rural areas.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('COL','Colombia is famous for its coffee, beautiful beaches, and diverse ecosystems ranging from Amazon rainforest to Andean mountains. The country has vibrant cultural traditions, including the colorful Carnaval de Barranquilla. Fun fact: Colombia is the world’s largest source of emeralds.','Mixed Public-Private Models with Universal Coverage - these countries combine government-funded services with private options. Colombia offers layered approaches - public systems serve the uninsured, while formal-sector or private insurance caters to others.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('COM','Comoros is a volcanic archipelago nation located in the Indian Ocean between Madagascar and Mozambique. Its culture is a blend of African, Arab, and French influences, and it’s known for its fragrant ylang-ylang flower. Fun fact: Comoros is one of the world’s top producers of ylang-ylang essential oil, used in high-end perfumes.','Comoros has a public healthcare system, but it is severely under-resourced. Many facilities lack basic supplies and trained staff. Most people pay out-of-pocket for services, and many seek care abroad when possible. International aid plays a key role in supporting health programs, particularly for maternal and child health.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('CRI','Costa Rica is famous for its rich biodiversity, lush rainforests, and commitment to environmental conservation. It’s a top ecotourism destination with volcanoes, beaches, and national parks. The country also has no standing army, focusing instead on peace and education. Fun fact: Costa Rica produces more than 99% of its electricity from renewable sources.','Costa Rica is often praised for its strong universal healthcare system, managed by the Costa Rican Social Security Fund (Caja). All residents, including legal foreigners, can access care by contributing to the system. The country has achieved impressive health indicators, including high life expectancy and low infant mortality, thanks to its focus on preventive care and widespread access.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('HRV','Croatia is famous for its stunning Adriatic coastline, dotted with over a thousand islands, historic cities like Dubrovnik and Split, and its rich Roman and medieval heritage. It has become a popular tourist destination for its beaches, national parks, and vibrant cultural scene. Fun fact: The city of Dubrovnik served as a filming location for King’s Landing in the TV series Game of Thrones.','National Health Service / Social Insurance Systems - these countries offer universal coverage funded through taxation or mandatory insurance contributions.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('CUB','Cuba is the largest Caribbean island, famous for its vibrant culture, classic cars, and historic architecture. Havana’s colonial charm and music scene are world-renowned. The island’s history is marked by its socialist government and rich Afro-Caribbean heritage. Fun fact: Cuba has one of the highest doctor-to-patient ratios in the world.','Mixed Public-Private Models with Universal Coverage - these countries combine government-funded services with private options. Also Unique Highly Specialized Systems with state-run universal healthcare with a strong emphasis on prevention and primary care—often surpasses regional peers in outcomes.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('CYP','Cyprus is an island nation in the Eastern Mediterranean with a complex history influenced by Greeks, Romans, Byzantines, and Ottomans. It’s known for its beautiful beaches, ancient ruins, and divided capital city, Nicosia. The island has a warm climate and rich folklore traditions. Fun fact: Cyprus is the mythical birthplace of Aphrodite, the Greek goddess of love and beauty.','Cyprus launched a universal healthcare system (GeSY) in 2019, aiming to provide equal access to quality care for all residents. It integrates both public and private providers, with services funded through payroll contributions. The transition has significantly improved affordability and access to healthcare services across the island.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('CZE','Czechia, or the Czech Republic, is famed for its historic capital Prague, with stunning Gothic and Baroque architecture. The country has a rich history of brewing beer and has some of the highest beer consumption per capita in the world. Its cultural heritage includes famous writers like Franz Kafka. Fun fact: The Prague Astronomical Clock, installed in 1410, is the third-oldest astronomical clock in the world and still operates.','National Health Service / Social Insurance Systems - these countries offer universal coverage funded through taxation or mandatory insurance contributions.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('COD','Often called DR Congo, this vast nation in Central Africa is the second-largest country on the continent. It holds some of the world’s most extensive tropical rainforests and abundant natural resources. Fun fact: DR Congo is traversed by the equator and contains Virunga National Park, Africa’s oldest national park and home to endangered mountain gorillas.','The DRC’s healthcare system is fragile and underfunded, with very limited access in rural areas. Most people rely on out-of-pocket payments for services, and many areas depend on NGOs for basic care. Infrastructure is poor, and the country frequently battles outbreaks of diseases like Ebola and cholera. Reforms are ongoing but face major challenges.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('DNK','Denmark is a Scandinavian country known for its progressive society, cycling culture, and historic Viking heritage. Copenhagen, its capital, is famous for its colorful Nyhavn harbor and the iconic Little Mermaid statue. Denmark consistently ranks high in happiness and quality of life. Fun fact: Denmark is home to LEGO, one of the world’s most popular toy brands, which originated there in 1932.','National Health Service / Social Insurance Systems - these countries offer universal coverage funded through taxation or mandatory insurance contributions.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('DJI','Djibouti is a small country in the Horn of Africa, located on strategic maritime routes between Africa and Asia. Its landscape features salt lakes, volcanic formations, and striking desert terrain. Fun fact: Lake Assal in Djibouti is the lowest point in Africa (–155 m/–509 ft) and one of the saltiest lakes in the world.','Djibouti has a public healthcare system with free or subsidized services, especially for maternal and child health. While primary healthcare is available, there are shortages of medical staff and equipment, especially outside the capital. The country partners with international organizations to improve access and combat diseases like tuberculosis and HIV.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('DMA','Dominica, known as the "Nature Island," is rich in rainforests, hot springs, and volcanic landscapes. It offers excellent hiking and diving opportunities and preserves indigenous Kalinago culture. Its rugged terrain keeps tourism relatively low-key and eco-focused. Fun fact: Dominica is home to the world''s second-largest boiling lake.','Dominica provides public healthcare services through hospitals and health centers, supported by government funding. Services are generally free or low-cost, and the country also integrates traditional medicine. Although the public system is widespread, resources are limited, and patients sometimes need referrals abroad for advanced treatment.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('DOM','The Dominican Republic shares the island of Hispaniola with Haiti and is known for its beautiful beaches, resorts, and vibrant music like merengue and bachata. Its colonial capital, Santo Domingo, is the oldest European settlement in the Americas. Fun fact: The Dominican Republic is the birthplace of baseball star David Ortiz.','Territories Under Larger States often have healthcare integrated with parent-country systems. French territories follow France''s universal health insurance model.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('TLS','East Timor is one of the world’s newest nations, having gained independence in 2002 from Indonesia. This Southeast Asian country boasts pristine beaches and a rich blend of Portuguese and Southeast Asian cultures. Fun fact: Despite its small size, East Timor has over 30 spoken languages, reflecting its deep ethnic and cultural diversity.','Socialized or Strong Primary Care Focus - offer publicly funded primary care through clinics; more complex services may require referral abroad.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ECU','Ecuador is a small but biodiverse country named after the equator, which runs through it. It’s famous for the Galápagos Islands, a UNESCO World Heritage site that inspired Charles Darwin’s theory of evolution. The Andes mountains and Amazon rainforest also make Ecuador a nature lover’s paradise. Fun fact: Ecuador was the first country to declare the rights of nature in its constitution.','Mixed Public-Private Models with Universal Coverage (Middle Income to High-Income Transition) - these countries combine universal access with private-sector options for supplemental or expedited care; typically, basic services are covered publicly or through social insurance, with optional private insurance to enhance service access or quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('EGY','Egypt is a transcontinental country spanning northeast Africa and southwest Asia via the Sinai Peninsula. It’s famous for ancient civilization landmarks like the Pyramids of Giza, the Sphinx, and the Nile River. Fun fact: The Great Pyramid of Khufu is one of the Seven Wonders of the Ancient World and the only one still mostly intact.','Mixed Public-Private Models with Universal Coverage (Middle Income to High-Income Transition) - these countries combine universal access with private-sector options for supplemental or expedited care; typically, basic services are covered publicly or through social insurance, with optional private insurance to enhance service access or quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SLV','El Salvador is the smallest Central American country, known for its volcanoes, surfing beaches, and rich indigenous culture. Despite its size, it boasts a diverse landscape with cloud forests and ancient Mayan ruins. Fun fact: El Salvador introduced the use of Bitcoin as legal tender in 2021.','Mixed Public-Private Models with Universal Coverage (Middle Income to High-Income Transition) - these countries combine universal access with private-sector options for supplemental or expedited care; typically, basic services are covered publicly or through social insurance, with optional private insurance to enhance service access or quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('GNQ','Equatorial Guinea consists of a mainland region (Río Muni) and several islands in the Gulf of Guinea, including Bioko. It’s oil-rich and one of the few African countries where Spanish is an official language. Fun fact: The tiny island of Bioko is home to the Bioko drill, a subspecies of primate found nowhere else in the world.','Equatorial Guinea has invested heavily in healthcare, thanks to oil revenues, but access remains uneven. The public system offers services with some state subsidies, but much of the population still faces barriers due to infrastructure gaps and a lack of healthcare professionals. Private care is growing but limited to urban centers.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ERI','Eritrea is a country in the Horn of Africa with a Red Sea coastline. It has ancient history tied to the Kingdom of Aksum and harbors well-preserved colonial architecture in its capital, Asmara. Fun fact: Asmara’s city center is a UNESCO World Heritage Site celebrated for its 1930s modernist Italian architecture.','Emerging Public Systems with Supportive Roles - these rely mostly on public provision with varying quality and heavy NGO/aid involvement; systems focusing on maternal/child health, infectious disease control, and basic primary care; capacity and quality vary by region.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('EST','Estonia is a Baltic nation with a strong digital economy and well-preserved medieval old towns, particularly in its capital Tallinn. It has deep forested areas and a vibrant startup culture, often considered one of the most technologically advanced countries globally. Fun fact: Estonia was the first country to hold nationwide elections over the internet in 2005.','Universal Coverage - Develop High-Income Nations (Single-Payer or Social Insurance) - These countries ensure broad access funded via taxes or mandatory insurance contributions; smaller territories maintain systems mirroring their larger neighbors via public funding and comprehensive care.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ETH','Ethiopia, located in the Horn of Africa, is one of the world’s oldest nations and the origin of coffee. It has its own writing system, calendar, and unique Christian traditions. Fun fact: Ethiopia was never colonized (except briefly by Italy); it is one of only two African countries with this distinction, and it''s the birthplace of coffee.','Emerging Public Systems with Supportive Roles - these rely mostly on public provision with varying quality and heavy NGO/aid involvement; systems focusing on maternal/child health, infectious disease control, and basic primary care; capacity and quality vary by region.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('FJI','Fiji is an archipelago of over 300 islands in the South Pacific, famous for its crystal-clear lagoons, coral reefs, and friendly local culture. It’s a popular destination for diving, snorkeling, and tropical relaxation. Fun fact: Fiji has over 300 different dialects spoken across its islands!','Socialized or Strong Primary Care Focus - offer publicly funded primary care through clinics; more complex services may require referral abroad.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('FIN','Finland, known as the “Land of a Thousand Lakes,” boasts pristine nature, vast forests, and the magical Northern Lights. Its society values education, design, and innovation. Helsinki, the capital, combines modern architecture with historical sites. Fun fact: Finland has more saunas than cars, with about 2 million saunas in a population of 5.5 million!','Universal Coverage - Develop High-Income Nations (Single-Payer or Social Insurance) - These countries ensure broad access funded via taxes or mandatory insurance contributions; has well-established systems providing universal healthcare with high-quality services and strong regulatory oversight.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('FRA','France is famed for its art, fashion, cuisine, and landmarks like the Eiffel Tower and Louvre Museum. Paris, the “City of Light,” is a global cultural capital. The country’s diverse geography includes Mediterranean beaches, Alpine mountains, and rolling vineyards. Fun fact: The French invented the bicycle and the hot air balloon, and the Louvre was originally a royal palace.','Universal Coverage - Develop High-Income Nations (Single-Payer or Social Insurance) - These countries ensure broad access funded via taxes or mandatory insurance contributions; has well-established systems providing universal healthcare with high-quality services and strong regulatory oversight.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('GAB','Gabon is a sparsely populated country along Africa’s west coast, largely covered by dense rainforest. It has significant oil reserves and strong conservation efforts. Fun fact: Nearly 90% of Gabon’s land is covered in rainforest, and over 10% is set aside as national parks, protecting species like forest elephants and gorillas.','Mixed Public-Private Models with Universal Coverage (Middle Income to High-Income Transition) - these countries combine universal access with private-sector options for supplemental or expedited care; typically, basic services are covered publicly or through social insurance, with optional private insurance to enhance service access or quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('GMB','The Gambia is the smallest country in mainland Africa, following the Gambia River inland from its Atlantic coast. It’s known for its vibrant cultural tapestry and wildlife sanctuaries. Fun fact: Despite being tiny, The Gambia is home to the Bijilo Forest Park, nicknamed “Monkey Park,” where you can stroll among free-roaming monkeys minutes from the capital, Banjul.','Gambia offers public healthcare services, though many are underfunded and understaffed. There is no universal insurance, so patients pay out-of-pocket, especially for medication. Donor-funded programs help with key services like maternal care and malaria prevention. Recent efforts aim to decentralize care and improve rural access.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('GEO','Georgia, located at the crossroads of Europe and Asia, is known for its stunning Caucasus mountain landscapes, ancient wine-making tradition, and unique language and alphabet. Tbilisi, the capital, blends old-world charm with modern influences. Fun fact: Georgia claims to have the world’s oldest known winery, dating back over 8,000 years.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: public coverage is strong and expanding, with private sectors catering to those seeking faster access or specialist services.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('DEU','Germany is Europe’s largest economy and known for its rich history, from the Holy Roman Empire to the modern era. It has vibrant cities like Berlin, famed for its art, history, and nightlife, and scenic regions like the Bavarian Alps and the Rhine River valley. Germany is also renowned for its engineering, beer culture, and Oktoberfest festival. Fun fact: Germany is home to the world’s first printed book, the Gutenberg Bible, produced around 1455.','National Health Service / Social Insurance Systems - these countries offer universal coverage funded through taxation or mandatory insurance contributions. Germany  uses compulsory health insurance with competing public insurers, ensuring comprehensive care.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('GHA','Ghana is a West African country known for its rich culture, historical sites, and vibrant democracy. It was the first sub-Saharan African country to gain independence from colonial rule in 1957. The nation is famous for its colorful kente cloth, diverse music styles like highlife and hiplife, and the Cape Coast Castle, a poignant symbol of the transatlantic slave trade. Fun fact: Ghana is home to Lake Volta, one of the world’s largest man-made lakes, which covers nearly 3.6% of the country''s total land area.','Mixed Public-Private Models with Universal Coverage (Middle Income to High-Income Transition) - these countries combine universal access with private-sector options for supplemental or expedited care; typically, basic services are covered publicly or through social insurance, with optional private insurance to enhance service access or quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('GRC','Greece is the cradle of Western civilization, democracy, and philosophy. Its ancient ruins like the Parthenon and the historic city of Athens attract millions of visitors. The country’s islands, such as Santorini and Mykonos, are famous for their stunning views and crystal-clear waters. Greek cuisine and hospitality are cherished worldwide. Fun fact: Greece has more archaeological museums than any other country in the world.','Universal Coverage - Develop High-Income Nations (Single-Payer or Social Insurance) - These countries ensure broad access funded via taxes or mandatory insurance contributions; has well-established systems providing universal healthcare with high-quality services and strong regulatory oversight.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('GRD','Grenada, known as the "Island of Spice," is famous for its production of nutmeg and mace. It features beautiful beaches, waterfalls, and coral reefs. The island has a rich colonial history with British and French influences. Fun fact: Grenada was the first country to export nutmeg and mace.','Grenada provides public healthcare through government-run hospitals and clinics, with services offered at little or no cost. The country also has a growing private sector. Although coverage is broad, the quality and availability of care vary, particularly in rural areas. Initiatives to upgrade infrastructure and digitize records are underway.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('GTM','Guatemala is a culturally rich country with strong Mayan heritage, stunning volcanoes, and colonial cities like Antigua. It’s known for vibrant textiles and traditional festivals. Lake Atitlán, surrounded by volcanoes, is one of its natural jewels. Fun fact: Guatemala’s Tikal National Park contains some of the largest and oldest Mayan ruins.','Mixed Public-Private Models with Universal Coverage (Middle Income to High-Income Transition) - these countries combine universal access with private-sector options for supplemental or expedited care; typically, basic services are covered publicly or through social insurance, with optional private insurance to enhance service access or quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('GIN','Guinea is located on the west coast of Africa and is rich in natural resources, especially bauxite, the ore used to make aluminum. The country is known for its strong traditions of drumming and dance. It has lush highlands, waterfalls, and the Fouta Djallon region, a source of several major West African rivers. Fun fact: Guinea is often called the “Water Tower of West Africa” because it contains the headwaters of the Niger, Senegal, and Gambia rivers.','Emerging Public Systems with Supportive Roles - these rely mostly on public provision with varying quality and heavy NGO/aid involvement; systems focusing on maternal/child health, infectious disease control, and basic primary care; capacity and quality vary by region.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('GNB','This small West African country has a picturesque coastline, an intricate mangrove ecosystem, and the remote Bijagós Archipelago. Despite political instability, Guinea-Bissau is rich in cultural heritage and biodiversity. The nation blends Portuguese colonial legacy with indigenous customs. Fun fact: The Bijagós Islands are a UNESCO Biosphere Reserve and one of the last refuges for rare saltwater hippos.','Emerging Public Systems with Supportive Roles - these rely mostly on public provision with varying quality and heavy NGO/aid involvement; systems focusing on maternal/child health, infectious disease control, and basic primary care; capacity and quality vary by region.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('GUY','Guyana is located on South America’s northern coast and is known for its dense rainforests and the spectacular Kaieteur Falls, one of the world’s tallest single-drop waterfalls. It has a culturally diverse population influenced by indigenous peoples, Africans, and Indians. Fun fact: Kaieteur Falls is about four times higher than Niagara Falls.','Guyana has a public healthcare system offering free services at government facilities. However, limited resources and understaffing, especially in remote regions, affect service quality. Private healthcare is available in urban areas and used by those who can afford it. The government is working to expand health access and improve infrastructure.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('HTI','Haiti occupies the western third of Hispaniola and is known for its vibrant art, music, and history as the first black republic and first country in the Western Hemisphere to abolish slavery. Its culture blends African, French, and Caribbean influences. Fun fact: Haiti’s Citadelle Laferrière is the largest fortress in the Americas.','Emerging Public Systems with Supportive Roles - these rely mostly on public provision with varying quality and heavy NGO/aid involvement; systems focusing on maternal/child health, infectious disease control, and basic primary care; capacity and quality vary by region.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('HND','Honduras is known for its lush rainforests, ancient Mayan ruins at Copán, and Caribbean beaches. It has a diverse landscape that includes mountains and tropical islands. The country’s culture is a mix of indigenous and Spanish influences. Fun fact: Honduras is home to the Mesoamerican Barrier Reef, the second largest barrier reef in the world.','Mixed Public-Private Models with Universal Coverage (Middle Income to High-Income Transition) - these countries combine universal access with private-sector options for supplemental or expedited care; typically, basic services are covered publicly or through social insurance, with optional private insurance to enhance service access or quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('HKG','Hong Kong is a vibrant financial hub on China’s southern coast, blending Eastern traditions with Western modernity. Famous for its skyline, bustling harbor, and unique status as a Special Administrative Region of China, it has a distinct cultural identity. Fun fact: Hong Kong has more skyscrapers than any other city in the world, with over 300 buildings taller than 150 meters.','Hong Kong boasts a world-class dual healthcare system. Public hospitals offer low-cost services, funded by the government, while private hospitals provide faster access for higher fees. The Hospital Authority manages the public system, known for efficiency, excellent outcomes, and advanced technology. Public satisfaction is generally high.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('HUN','Hungary is a landlocked country known for its capital Budapest, divided by the Danube River into Buda and Pest. It boasts beautiful thermal baths, baroque architecture, and a unique language unrelated to most European tongues. Hungarian cuisine is rich with paprika-spiced dishes. Fun fact: Budapest’s thermal baths have been used for relaxation and medicinal purposes since Roman times.','Universal Coverage - Develop High-Income Nations (Single-Payer or Social Insurance) - These countries ensure broad access funded via taxes or mandatory insurance contributions; has well-established systems providing universal healthcare with high-quality services and strong regulatory oversight.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ISL','Iceland is an island nation famous for its dramatic volcanic landscapes, geysers, glaciers, and hot springs. Despite its small population, it has a strong literary tradition and a high standard of living. The Northern Lights are a major attraction here. Fun fact: Iceland uses geothermal energy to heat about 90% of its homes, making it one of the greenest countries in the world.','Universal Coverage - Develop High-Income Nations (Single-Payer or Social Insurance) - These countries ensure broad access funded via taxes or mandatory insurance contributions; has well-established systems providing universal healthcare with high-quality services and strong regulatory oversight.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('IND','India is a vast and diverse country known for its rich history, vibrant cultures, and deep spiritual heritage. It''s the birthplace of major world religions such as Hinduism, Buddhism, Jainism, and Sikhism. From the Himalayan peaks to tropical beaches, India''s landscapes are as varied as its languages and cuisines. Fun fact: India has the world’s largest postal network, with over 150,000 post offices, including one on a floating barge in Dal Lake, Kashmir.','India has a mixed healthcare system, with a large private sector and an extensive but under-resourced public sector. Public hospitals offer free or subsidized services, but out-of-pocket expenses remain high due to limited access and trust in public facilities. The Ayushman Bharat scheme aims to provide free health coverage to over 500 million people, focusing on equity and universal health access.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('IDN','Indonesia is an archipelago of over 17,000 islands and is the fourth most populous country in the world. It is known for its biodiversity, volcanoes, and cultural richness, with hundreds of distinct ethnic groups and languages. Bali, one of its most famous islands, is a global tourist hotspot. Fun fact: Indonesia is home to Krakatoa, one of the most powerful volcanic eruptions in recorded history, which occurred in 1883.','Mixed Public-Private Models with Universal Coverage (Middle Income to High-Income Transition) - these countries combine universal access with private-sector options for supplemental or expedited care; typically, basic services are covered publicly or through social insurance, with optional private insurance to enhance service access or quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('IRN','Iran, historically known as Persia, has one of the world’s oldest civilizations. Renowned for its Persian architecture, poetry, and ancient ruins like Persepolis, Iran is also rich in natural resources and has a long history of empire and influence in the Middle East. Fun fact: The game of polo originated in ancient Persia and was initially a sport played by the royal elite.','Mixed Public-Private Models with Universal Coverage (Middle Income to High-Income Transition) - these countries combine universal access with private-sector options for supplemental or expedited care; typically, basic services are covered publicly or through social insurance, with optional private insurance to enhance service access or quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('IRQ','Iraq, often referred to as the cradle of civilization, was home to ancient Mesopotamian empires such as Sumer, Akkad, Babylon, and Assyria. Modern Iraq has endured conflict, but its historical and cultural significance remains enormous. Fun fact: The Code of Hammurabi, one of the earliest known sets of laws, was written in Babylon (modern-day Iraq) around 1754 BCE.','Transitional / Complex or Fragmented Systems - these countries exhibit a mix of public, private, and social-based coverage with varying degrees of access and equity: often have national health insurance or strong private role, still working on universalization and system reform.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('IRL','Ireland, known as the Emerald Isle, is famous for its lush green countryside, rich folklore, and friendly people. Dublin, the capital, is a hub for literature and history, with famous writers like James Joyce hailing from here. The country is also renowned for traditional music and the St. Patrick’s Day celebrations. Fun fact: Ireland is home to the longest coastal driving route in Europe, known as the Wild Atlantic Way.','National Health Service / Social Insurance Systems - these countries offer universal coverage funded through taxation or mandatory insurance contributions.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ISR','Israel is a small but geopolitically significant country in the Middle East, known for its religious importance to Judaism, Christianity, and Islam. It''s a modern technological powerhouse while also being home to ancient cities like Jerusalem and Nazareth. Fun fact: Israel has the highest number of startups per capita in the world and is often referred to as the "Startup Nation."','Universal Coverage - Develop High-Income Nations (Single-Payer or Social Insurance) - These countries ensure broad access funded via taxes or mandatory insurance contributions; has well-established systems providing universal healthcare with high-quality services and strong regulatory oversight.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ITA','Italy is a country of art, history, and gastronomy, famous for cities like Rome, Venice, and Florence. It is the birthplace of the Renaissance and home to landmarks such as the Colosseum, the Leaning Tower of Pisa, and the Vatican City. Italian cuisine, fashion, and automotive design have a global influence. Fun fact: Italy has more UNESCO World Heritage Sites than any other country in the world.','Universal Coverage - Develop High-Income Nations (Single-Payer or Social Insurance) - These countries ensure broad access funded via taxes or mandatory insurance contributions; has well-established systems providing universal healthcare with high-quality services and strong regulatory oversight.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('CIV','Ivory Coast is a culturally vibrant and economically significant West African country known for cocoa production—it’s the world’s largest producer. The country’s major cities like Abidjan and Yamoussoukro blend modern skyscrapers with French colonial charm. Fun fact: The Basilica of Our Lady of Peace in Yamoussoukro is the largest church in the world, even bigger than St. Peter’s Basilica in Vatican City.','Ivory Coast has a public health system, but access and quality are inconsistent, especially outside Abidjan. The government is expanding universal health coverage (CMU) to reduce out-of-pocket costs and increase equity. While healthcare infrastructure is improving, challenges remain in rural service delivery and workforce shortages.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('JAM','Jamaica is famous for reggae music, the Rastafari movement, and beautiful beaches like those in Negril. It has a rich cultural history and vibrant cuisine. Jamaica is also known for producing legendary athletes like Usain Bolt. Fun fact: Jamaica is the birthplace of the world-famous musician Bob Marley.','Jamaica operates a universal public healthcare system, funded by the government and free at the point of use in public hospitals and clinics. The Ministry of Health manages the system, focusing on primary care and health promotion. However, challenges persist in terms of long wait times, understaffing, and outdated equipment. A parallel private sector offers faster service but is expensive and mostly accessed by wealthier individuals or those with private insurance.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('JPN','Japan is an island nation in East Asia known for its unique blend of ancient traditions and cutting-edge technology. It boasts stunning natural landscapes—from cherry blossoms in the spring to snow-covered mountains in Hokkaido—and a culture deeply rooted in respect, aesthetics, and precision. The country''s capital, Tokyo, is one of the most populous and advanced cities in the world. Fun fact: Japan is home to the world’s oldest company, Kongō Gumi, a construction company founded in 578 AD that specialized in building Buddhist temples.','Universal Coverage - Develop High-Income Nations (Single-Payer or Social Insurance) - These countries ensure broad access funded via taxes or mandatory insurance contributions; has well-established systems providing universal healthcare with high-quality services and strong regulatory oversight.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('JOR','Jordan is a peaceful and historically rich country in the heart of the Middle East. It''s famous for ancient archaeological sites like Petra, a rock-cut city dating back to 300 BCE, and the Dead Sea, Earth’s lowest land point. Jordan has long been a crossroads of religions and cultures. Fun fact: The Dead Sea is so salty that people can effortlessly float in it—and it’s almost 10 times saltier than ocean water!','Mixed Public-Private Models with Universal Coverage (Middle Income to High-Income Transition) - these countries combine universal access with private-sector options for supplemental or expedited care; typically, basic services are covered publicly or through social insurance, with optional private insurance to enhance service access or quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('KAZ','Kazakhstan is the largest landlocked country in the world and spans both Europe and Asia. Known for its vast steppes, mineral wealth, and nomadic heritage, Kazakhstan has a growing urban scene, especially in cities like Astana and Almaty. It was once a central part of the ancient Silk Road. Fun fact: Kazakhstan is where space travel began—the Baikonur Cosmodrome is the launch site of the world’s first human in space, Yuri Gagarin, in 1961.','Mixed Public-Private Models with Universal Coverage (Middle Income to High-Income Transition) - these countries combine universal access with private-sector options for supplemental or expedited care; typically, basic services are covered publicly or through social insurance, with optional private insurance to enhance service access or quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('KEN','Kenya is one of Africa’s most famous safari destinations, known for its dramatic landscapes—from the Great Rift Valley to Mount Kenya—and its vast savannas teeming with wildlife. It has rich traditions among its 40+ ethnic groups, including the Maasai and Kikuyu. Fun fact: Kenya hosts the Great Migration, one of the most spectacular wildlife events on Earth, as millions of wildebeest, zebras, and gazelles move between Kenya’s Maasai Mara and Tanzania’s Serengeti.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: public systems with rising national insurance schemes, often supplemented by private providers.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('KIR','Kiribati consists of 33 coral atolls and reef islands spread over a vast area of the central Pacific Ocean. It’s known for its beautiful lagoons and strong cultural traditions centered on the ocean. Fun fact: Kiribati is one of the first places in the world to see the sunrise each day.','Kiribati provides free healthcare to all citizens, with services delivered through a network of hospitals and clinics across its many islands. The Ministry of Health emphasizes primary and preventive care, but geographic dispersion and limited infrastructure make access difficult. Serious conditions are often referred overseas, typically to Fiji or New Zealand, due to the lack of specialized services.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('KWT','Kuwait is a small but wealthy nation in the Persian Gulf, known for its vast oil reserves and modern urban development. With a mix of desert landscapes and coastal culture, Kuwait plays a significant role in global energy markets. Despite its size, it maintains a strong cultural identity shaped by Arab traditions, Islamic heritage, and a history of maritime trade. Fun fact: Kuwait was the first Gulf country to establish a constitution and parliament in 1962, making it one of the region’s earliest adopters of a parliamentary system.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: middle Eastern Gulf states with extensive public healthcare complemented by private hospitals and clinics.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('KGZ','Kyrgyzstan is a landlocked, mountainous country in Central Asia, celebrated for its breathtaking natural beauty—especially Lake Issyk-Kul and the Tien Shan mountain range. Its culture is deeply rooted in nomadic traditions, still seen in its festivals, horseback games, and yurts. Fun fact: Kyrgyzstan is one of the few countries where the traditional sport of kok-boru (goat polo) is still widely played—teams on horseback compete by trying to carry a goat carcass into the opposing team’s goal.','Transitional / Support-Mixed Systems - countries with complex mixes of public, private, and social-insurance components: heavy public system presence with layered private insurance, undergoing reform and decentralization.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('LAO','Laos is a serene, landlocked nation in Southeast Asia known for its misty mountains, Buddhist monasteries, and the slow-paced charm of the Mekong River. It''s less commercialized than many of its neighbors, offering a more tranquil experience of traditional Southeast Asian life. Fun fact: Laos is the most heavily bombed country per capita in history, due to U.S. air raids during the Vietnam War. Yet today, it remains one of the most peaceful and spiritually rich places in the region.','Laos has a developing public healthcare system, where services are provided at subsidized rates, but out-of-pocket payments are still common, especially in rural regions. The government is working toward universal health coverage and has implemented community-based health insurance and health equity funds to improve affordability. Access to care and skilled professionals remains limited outside major cities.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('LVA','Latvia is a Baltic country known for its rich history, beautiful Riga Old Town, and vast forests. It has a strong tradition of folk music and dance, with midsummer celebrations being particularly important. Latvia combines medieval charm with modern development. Fun fact: Latvia hosts one of the largest choral festivals in the world, celebrated every five years.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: transitional Eastern European nations with universal or near-universal coverage financed by public/social health insurance.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('LBN','Lebanon, situated on the eastern shore of the Mediterranean, is a country of deep historical significance and stunning cultural diversity. From Roman ruins in Baalbek to vibrant nightlife in Beirut, it offers a unique blend of East and West. The cuisine, language, and art reflect influences from Phoenician, Arab, Ottoman, and French cultures. Fun fact: Lebanon is home to the oldest continuously inhabited city in the world—Byblos, which has been lived in for over 7,000 years!','Transitional / Support-Mixed Systems - countries with complex mixes of public, private, and social-insurance components: heavy public system presence with layered private insurance, undergoing reform and decentralization.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('LSO','Lesotho is a small, mountainous country entirely surrounded by South Africa. It’s often called the "Kingdom in the Sky" due to its high elevation. Traditional Basotho culture remains strong, especially visible in clothing like the iconic wool blanket. Fun fact: Lesotho is the only independent country in the world that lies entirely above 1,000 meters (3,281 feet) in elevation.','Lesotho offers public healthcare services through government-run hospitals and health centers, and care is generally low-cost or free. However, access in mountainous rural areas is limited. The country has partnered with private entities and international donors (e.g., a PPP hospital in Maseru) to improve quality and coverage. HIV/AIDS care is a major public health focus.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('LBR','Liberia is a coastal West African nation founded by freed African-American slaves in the 19th century. Its capital, Monrovia, is named after U.S. President James Monroe. Liberia has a unique history and is rich in cultural diversity and natural beauty. Fun fact: Liberia was the first African republic to declare independence (in 1847) and the only African country never formally colonized by a European power.','Developing-Nation Public Systems with Aid Support - characterized by limited coverage capacity, heavy donor/NGO involvement, and varying quality: these countries focus on essential services (maternal/child health, infectious disease), with limited infrastructure and geographical disparities.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('LBY','Libya is a North African country bordered by the Mediterranean Sea and the Sahara Desert. Known for its vast oil reserves, Libya also has ancient Roman ruins like those in Leptis Magna and Sabratha. Fun fact: Leptis Magna, a Roman city near Tripoli, is one of the best-preserved ancient Roman sites in the world and offers a glimpse of life nearly 2,000 years ago.','Libya had a well-established public healthcare system offering free services under Gaddafi''s regime. However, decades of conflict have severely damaged the infrastructure, and today, the system is under strain due to instability, a shortage of medicines, and limited healthcare personnel. Although care is still technically free, many citizens rely on private clinics or seek care abroad when possible.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('LIE','Liechtenstein is a tiny Alpine country nestled between Switzerland and Austria. Despite its size, it’s known for its medieval castles, scenic mountain landscapes, and status as a wealthy financial center. It’s one of the world’s only doubly landlocked countries. Fun fact: Liechtenstein issues its own postage stamps, which are popular collectibles worldwide.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: typically tax-based or social insurance-funded universal systems that prioritize accessibility and quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('LTU','Lithuania, the southernmost Baltic state, has a rich history of medieval castles and baroque architecture. Vilnius, its capital, is famous for a large old town with cobblestone streets and churches. Lithuania was the first Soviet republic to declare independence in 1990. Fun fact: Lithuania is known for its basketball passion, often called the country''s second religion.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: transitional Eastern European nations with universal or near-universal coverage financed by public/social health insurance.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('LUX','Luxembourg is a small, wealthy country nestled between Belgium, France, and Germany. Known for its fortified medieval old town and as a major financial hub, Luxembourg boasts a high standard of living. The country is multilingual, with Luxembourgish, French, and German commonly spoken. Fun fact: Luxembourg is one of the world’s richest countries per capita and has one of the highest GDPs relative to population.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: typically tax-based or social insurance-funded universal systems that prioritize accessibility and quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MKD','North Macedonia is a landlocked Balkan country with a rich mix of cultures and history. Its capital, Skopje, features statues and architecture reflecting its diverse heritage, including Roman, Byzantine, and Ottoman influences. The country is also known for its beautiful lakes and mountains. Fun fact: Lake Ohrid in North Macedonia is one of Europe’s deepest and oldest lakes, home to unique ancient species.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: transitional Eastern European nations with universal or near-universal coverage financed by public/social health insurance.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MDG','Madagascar, an island nation off the southeastern coast of Africa, is renowned for its unique biodiversity. Over 90% of its wildlife is found nowhere else on Earth, including lemurs, baobab trees, and chameleons. Fun fact: Madagascar is the fourth-largest island in the world and has more than 100 species of lemurs—nowhere else in the world are lemurs naturally found.','Madagascar provides public healthcare services at low cost, but most people pay out-of-pocket, particularly for medication and diagnostics. Rural areas often lack facilities and trained staff. International donors and NGOs play a major role in health service delivery. Maternal and child health are priority areas, along with efforts to combat malaria and infectious diseases.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MWI','Malawi, known as the “Warm Heart of Africa,” is a landlocked country in southeastern Africa centered around Lake Malawi.  The lake itself is a UNESCO World Heritage Site and home to more fish species than any other lake on Earth. Fun fact: Lake Malawi contains more species of freshwater fish than all of Europe and North America combined, many of which are colorful cichlids.','Malawi has a free public healthcare system, funded largely by the government and external donors. Services are delivered through a tiered system of health centers, district hospitals, and central hospitals. Although services are free, shortages of supplies, staff, and equipment are widespread. The country has made significant progress in HIV treatment and maternal care, but infrastructure challenges persist.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MYS','Malaysia is a vibrant country in Southeast Asia, split between the Malay Peninsula and Borneo Island. It’s known for its multicultural society, which includes Malays, Chinese, Indians, and indigenous groups, all contributing to a rich cultural mosaic. From tropical beaches to bustling cities like Kuala Lumpur, Malaysia is both a natural and urban wonder. Fun fact: The Petronas Towers in Kuala Lumpur were the tallest buildings in the world from 1998 to 2004 and remain the tallest twin towers to this day.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: public coverage is strong and expanding, with private sectors catering to those seeking faster access or specialist services.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MDV','The Maldives is a tropical paradise in the Indian Ocean, made up of over 1,000 coral islands grouped in 26 atolls. It''s world-renowned for its crystal-clear waters, luxury overwater bungalows, and vibrant marine life, making it a top destination for honeymooners and scuba divers. The country''s culture is a unique blend of South Asian, African, and Arab influences. Fun fact: The Maldives is the lowest country on Earth, with an average ground level of just 1.5 meters (4 ft 11 in) above sea level—making it particularly vulnerable to climate change and rising ocean levels.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: middle Eastern Gulf states with extensive public healthcare complemented by private hospitals and clinics.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MLI','Mali is a landlocked country in West Africa with a rich cultural legacy that includes the great empires of Ghana, Mali, and Songhai. It was once home to Timbuktu, a legendary center of Islamic learning and trade. Today, Mali’s traditions live on in its music, especially the griots—storytellers and musicians who preserve oral history. Fun fact: Timbuktu was once considered the intellectual capital of the Islamic world and housed one of the world’s first universities, with thousands of ancient manuscripts still preserved today.','Mali’s healthcare system is decentralized, with public services subsidized by the state, but many services still require out-of-pocket payment. Access to care is limited in rural and conflict-affected regions. The government works with international partners to deliver essential services, including vaccinations and maternal care. Ongoing conflict hampers consistent healthcare delivery.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MLT','Malta is a small island nation in the Mediterranean Sea known for its historic sites dating back to the Neolithic period and its role in the Knights of St. John era. Its warm climate, clear blue waters, and vibrant culture make it a popular tourist destination. Fun fact: Malta has one of the world’s oldest free-standing structures, the Ġgantija Temples, built around 3600 BC.','Malta has a universal, high-quality healthcare system funded through general taxation. Public healthcare is free at the point of use for all citizens and includes hospitals, clinics, and specialized services. Private healthcare is also available for faster access or additional options. Malta consistently ranks highly in European health indices due to its accessibility, quality, and health outcomes.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MHL','The Marshall Islands are a group of atolls and islands in the central Pacific Ocean, known for their WWII history and rich marine biodiversity. The islands have a close relationship with the United States through the Compact of Free Association. Fun fact: Bikini Atoll, part of the Marshall Islands, was used for nuclear testing during the 1940s and 1950s.','Socialized or Strong Primary Care-Centered Models - systems emphasize universal primary and family care, often state-run: mainly government-funded frontline care; complex cases often referred overseas.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MRT','Mauritania, straddling North and West Africa, is mostly desert and part of the vast Sahara. It is known for its nomadic heritage, ancient trading towns, and striking desert landscapes. The people, mainly Moors and sub-Saharan Africans, maintain strong oral and musical traditions. Fun fact: Chinguetti, a Mauritanian desert town, is one of Islam’s seven holy cities and was once a major center of learning with libraries full of medieval manuscripts.','Mauritania offers public healthcare services, but access is limited and of variable quality, especially outside Nouakchott. The system is underfunded, and patients often bear out-of-pocket costs, particularly for medication. Maternal and child health programs, often supported by international donors, are key pillars of public health efforts.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MUS','Mauritius is a small island nation in the Indian Ocean known for its idyllic beaches, volcanic landscapes, and multicultural society. Influences from Indian, African, European, and Chinese cultures shape its cuisine, festivals, and language. Fun fact: Mauritius was the only known home of the dodo, a flightless bird that became extinct in the 17th century and remains one of the world''s most famous extinct animals.','Mauritius has a universal healthcare system, where public hospitals and clinics provide free services. The government prioritizes preventative and primary care, and the country maintains strong health indicators relative to the region. A growing private sector complements the public system, offering more specialized and faster services for those who can pay or have insurance.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MEX','Mexico offers a rich blend of indigenous and Spanish culture, with ancient ruins like Chichen Itza, vibrant cities, and delicious cuisine. It is known for its music, art, and festivals such as Día de los Muertos. Fun fact: Mexico introduced chocolate, corn, and chilies to the world.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: public coverage is strong and expanding, with private sectors catering to those seeking faster access or specialist services.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('FSM','The Federated States of Micronesia include over 600 islands in the western Pacific Ocean. The country is rich in marine life, ancient stone ruins, and traditional culture. Fun fact: Micronesia is home to the Nan Madol ruins, sometimes called the “Venice of the Pacific” due to its canals.','Socialized or Strong Primary Care-Centered Models - systems emphasize universal primary and family care, often state-run: mainly government-funded frontline care; complex cases often referred overseas.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MDA','Moldova is a landlocked country between Romania and Ukraine, known for its wine production and rolling hills. It has a rich history of monasteries and medieval fortresses. Despite being one of Europe’s lesser-known countries, its wine cellars rank among the largest in the world. Fun fact: Moldova’s Milestii Mici winery holds the Guinness World Record for the largest wine collection.','Moldova operates a mandatory health insurance system, with contributions from both employers and the government. Basic health services are accessible to all citizens, and the public sector dominates service delivery. However, underfunding and corruption have challenged system efficiency. Reforms are underway to improve primary care and reduce informal payments.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MCO','Monaco is a tiny, affluent city-state on the French Riviera known for luxury, casinos, and the famous Grand Prix. It is the second smallest country in the world and a playground for the rich and famous, with no income tax for residents. Fun fact: Monaco has its own Olympic team despite its small size and population.','Monaco offers world-class, universal healthcare to its citizens and residents. The system is funded through compulsory insurance and state subsidies. Public hospitals are highly specialized and technologically advanced. The state also partners with private providers to offer one of the most comprehensive and high-quality health systems in Europe.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MNG','Mongolia is a vast, rugged country between Russia and China, known for its expansive steppes, nomadic heritage, and the legacy of Genghis Khan. Its capital, Ulaanbaatar, is the cultural and political hub, but much of the population still lives a traditional lifestyle, herding livestock and moving with the seasons. Fun fact: Mongolia is the least densely populated country in the world, with only about two people per square kilometer—offering endless open skies and a strong sense of solitude.','Mongolia has a universal healthcare system funded through a mix of government revenue and social health insurance. Basic services are widely accessible, and the country has invested in primary care and maternal health. However, rural access is hampered by vast distances, harsh weather, and infrastructure issues, prompting efforts to improve mobile and telemedicine services.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MNE','Montenegro is a scenic Balkan country on the Adriatic coast, famous for its fjord-like bay, medieval towns, and mountainous national parks. It’s a growing tourist destination with a blend of Mediterranean and Slavic cultures. Fun fact: Montenegro is home to Durmitor National Park, a UNESCO World Heritage site known for its glacial lakes.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: transitional Eastern European nations with universal or near-universal coverage financed by public/social health insurance.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MAR','Morocco is a North African country with a rich mix of Arab, Berber, and European influences. From the bustling souks of Marrakech to the blue city of Chefchaouen, Morocco offers an explosion of colors, flavors, and traditions. It also boasts diverse landscapes, including beaches, mountains, and the Sahara Desert. Fun fact: Morocco is home to the oldest continuously operating university in the world—Al Quaraouiyine University in Fez, founded in 859 AD by a woman named Fatima al-Fihri.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: public coverage is strong and expanding, with private sectors catering to those seeking faster access or specialist services.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MOZ','Mozambique is a southeastern African country known for its extensive Indian Ocean coastline, vibrant music and dance, and Portuguese heritage. It offers pristine beaches, coral reefs, and offshore islands, making it a hidden gem for eco-tourism. Fun fact: Mozambique Island, a UNESCO World Heritage Site, was the former capital during Portuguese rule and is one of Africa’s oldest colonial settlements.','Developing-Nation Public Systems with Aid Support - characterized by limited coverage capacity, heavy donor/NGO involvement, and varying quality: these countries focus on essential services (maternal/child health, infectious disease), with limited infrastructure and geographical disparities.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('MMR','Myanmar, also known as Burma, is a Southeast Asian nation with a complex history and remarkable cultural diversity. It''s known for ancient temples, such as those in Bagan, and colonial architecture from British rule. The country has faced political and economic struggles but remains culturally rich with strong Buddhist traditions. Fun fact: The city of Bagan has over 2,000 Buddhist temples and pagodas, earning it the nickname "The Land of a Thousand Temples."','Developing-Nation Public Systems with Aid Support - characterized by limited coverage capacity, heavy donor/NGO involvement, and varying quality: these countries focus on essential services (maternal/child health, infectious disease), with limited infrastructure and geographical disparities.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('NAM','Namibia is known for its striking desert landscapes, especially the towering red dunes of Sossusvlei in the Namib Desert—one of the oldest deserts in the world. Wildlife is abundant, especially in Etosha National Park, where animals gather at natural waterholes. Fun fact: Namibia was the first country in the world to include environmental conservation in its constitution, leading to successful community-led wildlife preservation programs.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: middle-income African countries seeking universal access through mixed-finance public systems.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('NRU','Nauru is the world’s smallest island nation, located in Micronesia. It has a history of phosphate mining that greatly affected its economy and environment. Fun fact: Nauru is the third smallest country by area in the world, after Vatican City and Monaco.','Nauru offers free healthcare to its citizens, supported largely by Australian aid and foreign healthcare workers. The government operates a central hospital that provides basic care, but serious or specialized cases are referred abroad, primarily to Australia or Fiji. The health system faces challenges due to non-communicable diseases like obesity and diabetes.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('NPL','Nepal is a landlocked country nestled in the Himalayas, famous for its mountainous terrain and spiritual depth. Home to eight of the world’s ten tallest peaks—including Mount Everest—Nepal is a haven for trekkers and adventurers. It’s also deeply spiritual, being the birthplace of Siddhartha Gautama (the Buddha) and housing sacred Hindu temples. Fun fact: Nepal is the only national flag in the world that isn’t rectangular—its flag consists of two stacked triangles, symbolizing the Himalayas and the country''s two major religions, Hinduism and Buddhism.','Developing-Nation Public Systems with Aid Support - characterized by limited coverage capacity, heavy donor/NGO involvement, and varying quality: these countries focus on essential services (maternal/child health, infectious disease), with limited infrastructure and geographical disparities.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('NLD','The Netherlands is famous for its flat landscape, extensive canal systems, tulip fields, windmills, and cycling culture. Amsterdam, its capital, is known for museums, historic houses, and a vibrant arts scene. The Dutch are pioneers in water management and land reclamation. Fun fact: About 27% of the Netherlands lies below sea level, protected by an advanced system of dikes.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: typically tax-based or social insurance-funded universal systems that prioritize accessibility and quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('NZL','New Zealand is known for its stunning landscapes, from fjords and mountains to rolling hills. It’s famous for Maori culture, adventurous outdoor activities, and being a filming location for the “Lord of the Rings” movies. Fun fact: New Zealand was the first country to give women the right to vote in 1893.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: typically tax-based or social insurance-funded universal systems that prioritize accessibility and quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('NIC','Nicaragua is known for its volcanoes, lakes, and colonial cities like Granada. It has diverse ecosystems, from rainforests to beaches on both the Pacific and Caribbean coasts. The country is culturally rich with indigenous and Spanish influences. Fun fact: Nicaragua is home to the largest freshwater island in a freshwater lake—Ometepe Island in Lake Nicaragua.','Nicaragua has a universal healthcare system offering free care at public facilities, including hospitals and health posts. However, services are often limited by resource constraints and long wait times. The government emphasizes primary care and vaccination programs, but rural areas continue to face significant barriers to quality care.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('NER','Niger is a landlocked West African country dominated by the Sahara Desert. It has a long history as a crossroads of trans-Saharan trade and is home to diverse ethnic groups, including the Tuareg and Hausa. Fun fact: The ancient city of Agadez has one of the tallest mud-brick minarets in the world and was once a key stop for caravans crossing the desert.','Developing-Nation Public Systems with Aid Support - characterized by limited coverage capacity, heavy donor/NGO involvement, and varying quality: these countries focus on essential services (maternal/child health, infectious disease), with limited infrastructure and geographical disparities.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('NGA','Nigeria is Africa’s most populous country and a powerhouse of culture, music, and economy. It is home to over 250 ethnic groups, including the Yoruba, Igbo, and Hausa. From Nollywood (its booming film industry) to Afrobeats music, Nigeria is a leader in African pop culture. Fun fact: Lagos, Nigeria’s largest city, is one of the fastest-growing cities in the world and is expected to become the world’s most populous city by the end of the century.','Nigeria has a public healthcare system, but most Nigerians rely on out-of-pocket payments due to poor public service delivery. The National Health Insurance Scheme (NHIS) exists but has low enrollment. Urban centers have better facilities, while rural areas face severe shortages. Maternal and child health, malaria, and infectious disease control are key focus areas.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('PRK','North Korea is one of the most secretive and isolated nations in the world, ruled by a dynastic regime. Despite international tensions, it has a strong cultural identity and an emphasis on military and national pride. Its capital, Pyongyang, features grand monuments and planned architecture. Fun fact: North Korea has its own time zone, “Pyongyang Time,” which was set 30 minutes behind South Korea''s in 2015 (though it was later reverted in 2018).','North Korea claims to offer free, universal healthcare, but in reality, the system is underfunded and lacks medical supplies, especially outside the capital. Access to care is highly unequal, and international organizations report that many facilities are dilapidated. Some citizens pay unofficially for better treatment. The regime restricts outside access, making accurate assessments difficult.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('NOR','Norway is renowned for its stunning fjords, mountains, and northern lights. It has a high standard of living and is a major oil producer. Oslo, its capital, is a modern city blending nature and urban life, while its Viking history is celebrated across the country. Fun fact: Norway has more than 1,000 fjords, carved by glaciers thousands of years ago.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: typically tax-based or social insurance-funded universal systems that prioritize accessibility and quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('OMN','Oman is an Arabian Peninsula country known for its diverse landscapes, from rolling sand dunes to lush wadis and rugged mountains. It has preserved much of its traditional culture, with historic forts, a strong maritime legacy, and a society that prizes hospitality and modesty. Unlike some of its neighbors, Oman has developed slowly and sustainably. Fun fact: Oman is home to one of the world’s oldest independent states, with a monarchy that traces its roots back more than 2,000 years.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: middle Eastern Gulf states with extensive public healthcare complemented by private hospitals and clinics.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('PAK','Pakistan is a country of immense cultural, geographic, and historical richness—ranging from snow-covered peaks in the north to desert and coastline in the south. It’s home to ancient civilizations like the Indus Valley, as well as vibrant cities like Lahore and Karachi. With a diverse population, Pakistan boasts a rich tapestry of languages, art, and cuisine. Fun fact: The Karakoram Highway in Pakistan is often dubbed the “Eighth Wonder of the World”—it''s the highest paved international road, connecting Pakistan and China through some of the world’s most dramatic mountain scenery.','Mixed Public-Private Models with Universal Coverage (Middle Income to High-Income Transition) - these countries combine universal access with private-sector options for supplemental or expedited care; typically, basic services are covered publicly or through social insurance, with optional private insurance to enhance service access or quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('PLW','Palau is an island country famous for its marine biodiversity and pristine coral reefs, making it a top destination for divers. It also has rich WWII history and traditional island cultures. Fun fact: Palau was the first country to create a shark sanctuary, banning shark fishing in its waters.','Socialized or Strong Primary Care-Centered Models - systems emphasize universal primary and family care, often state-run: mainly government-funded frontline care; complex cases often referred overseas.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('PAN','Panama is famous for the Panama Canal, which connects the Atlantic and Pacific Oceans, boosting global trade. The country has tropical rainforests and a vibrant mix of indigenous and immigrant cultures. Panama City features a modern skyline alongside colonial history. Fun fact: The Panama Canal took over 10 years to build and is considered one of the greatest engineering feats of the 20th century.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: public coverage is strong and expanding, with private sectors catering to those seeking faster access or specialist services.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('PNG','Papua New Guinea is known for its cultural diversity, with over 800 languages spoken. It has dense rainforests, active volcanoes, and a rich variety of wildlife. Fun fact: Papua New Guinea is home to the world’s largest butterfly, the Queen Alexandra’s birdwing.','Papua New Guinea provides free primary healthcare, but services are often limited by geography, infrastructure, and shortages of healthcare professionals. Rural areas, home to most of the population, struggle with access. Major health issues include malaria, maternal mortality, and TB. The government is working with international partners to strengthen the system.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('PRY','Paraguay is a landlocked country rich in cultural heritage with a strong Guaraní influence in language and traditions. It is known for its large hydroelectric dams and vast Chaco region, which is sparsely populated and filled with wildlife. Fun fact: Paraguay is one of only two countries in South America without a coastline (the other is Bolivia).','Paraguay has a mixed public-private healthcare system, where public care is free, but often underfunded and overcrowded. Many people rely on private clinics for faster service. The Ministry of Public Health aims to expand universal access, but regional disparities and out-of-pocket costs remain significant challenges.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('PER','Peru is renowned for Machu Picchu, the ancient Incan city nestled high in the Andes, and its rich indigenous history. The country offers diverse environments from Amazon rainforest to Pacific coast deserts and high mountain ranges. Fun fact: Peru is home to the potato, with thousands of native varieties cultivated there.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: public coverage is strong and expanding, with private sectors catering to those seeking faster access or specialist services.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('PHL','The Philippines is a Southeast Asian archipelago consisting of over 7,600 islands, celebrated for its stunning beaches, friendly locals, and diverse culture. With a mix of indigenous, Spanish, American, and Chinese influences, it offers everything from colonial architecture to lively festivals and a booming street food scene. Tagalog and English are both official languages, and karaoke is a national pastime. Fun fact: The Philippines is home to the world’s longest underground river, the Puerto Princesa Subterranean River, which stretches over 8.2 km and flows directly into the sea.','The Philippines has a universal healthcare law, with PhilHealth (the national insurance program) covering most of the population. Public services are heavily subsidized, though patients still incur costs for medicines and diagnostics. Access is good in urban areas but uneven in rural regions. A strong private sector offers more specialized care for those who can afford it.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('POL','Poland has a rich history as a cultural and political center in Central Europe. Cities like Kraków and Warsaw showcase medieval architecture and modern resilience. The country has diverse landscapes including mountains, lakes, and forests. Fun fact: Poland is home to the world’s biggest castle by surface area — the Malbork Castle.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: transitional Eastern European nations with universal or near-universal coverage financed by public/social health insurance.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('PRT','Portugal is a southwestern European country on the Iberian Peninsula, known for its rich maritime history, beautiful beaches, and vibrant culture. Lisbon, its capital, features historic neighborhoods and a growing arts scene. Portugal is famous for its traditional Fado music and delicious cuisine like pastéis de nata. Fun fact: Portugal is home to the world’s oldest operating bookstore, Livraria Bertrand, opened in 1732 in Lisbon.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: transitional Eastern European nations with universal or near-universal coverage financed by public/social health insurance.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('QAT','Qatar is a small but influential country on the Arabian Peninsula, known for its wealth from natural gas and oil. Its capital, Doha, has quickly become a modern city filled with skyscrapers, cultural institutions like the Museum of Islamic Art, and futuristic stadiums built for the 2022 FIFA World Cup. Despite its rapid development, Qatar retains deep-rooted Bedouin traditions. Fun fact: Qatar is the richest country in the world by GDP per capita, and its population is made up of over 85% expatriates.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: typically tax-based or social insurance-funded universal systems that prioritize accessibility and quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('COG','The Republic of the Congo is a country in Central Africa bordered by rainforests and the Congo River. It has a rich biodiversity and traditional music scene. Fun fact: The country is home to the Nouabalé-Ndoki National Park, part of a vast Congo Basin biosphere teeming with wildlife like forest elephants and lowland gorillas.','The Republic of the Congo offers public healthcare services at low cost, but access and quality vary widely. Urban areas have more facilities, while rural areas lack infrastructure. The country faces a double burden of infectious diseases and rising non-communicable diseases, and healthcare delivery is challenged by limited funding and staff shortages.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ROU','Romania is a country of diverse landscapes, from the Carpathian Mountains to the Black Sea coast. It is famous for its medieval castles, including Bran Castle, often linked to the Dracula legend. Romania blends Latin and Eastern European cultures with a rich folklore tradition. Fun fact: The Palace of the Parliament in Bucharest is the second largest administrative building in the world, after the Pentagon.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: transitional Eastern European nations with universal or near-universal coverage financed by public/social health insurance.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('RUS','Russia is the largest country in the world by land area, spanning Eastern Europe and northern Asia. It boasts diverse landscapes ranging from tundra and forests to mountains and subtropical beaches along the Black Sea. With a rich cultural and political history, Russia is known for its contributions to literature, ballet, and space exploration. Moscow, its capital, is home to iconic landmarks like the Kremlin and Red Square. Fun fact: Russia has 11 time zones, more than any other country in the world.','Uniquely Highly Specialized Systems - universal public system funded through general taxation but challenged by hospital-centric infrastructure and regional disparities.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('RWA','Rwanda, known as the "Land of a Thousand Hills," is a lush, mountainous country in East Africa. Despite its tragic history, Rwanda has emerged as a model of economic growth and environmental sustainability. It is one of the best places to see endangered mountain gorillas in the wild. Fun fact: Rwanda was the first country in the world to ban plastic bags entirely and is one of the cleanest nations in Africa thanks to its monthly nationwide community cleanup day, Umuganda.','Rwanda is considered a success story in African healthcare reform. The country has implemented universal community-based health insurance (Mutuelles de Santé), which significantly increased access to care. The system emphasizes primary and preventive care, and Rwanda has seen major gains in life expectancy, maternal health, and HIV treatment in recent decades.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('KNA','This two-island nation is known for its lush landscapes, historic sugar plantations, and peaceful beaches. It has a small population and a growing tourism sector focused on eco-friendly experiences. Fun fact: Saint Kitts is home to one of the oldest surviving railway systems in the Western Hemisphere, built for sugar cane transport.','Saint Kitts and Nevis has a public healthcare system that provides subsidized care, including at general hospitals and health centers. While basic services are widely available, specialist care is limited, and many people seek treatment overseas. The government has worked to expand insurance coverage and improve chronic disease management.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('LCA','Saint Lucia is famous for the Pitons, twin volcanic peaks that are a UNESCO World Heritage Site. It has beautiful rainforests, beaches, and a strong French and British cultural influence. Fun fact: Saint Lucia is one of the few places where you can see the rare and colorful Saint Lucia parrot.','Saint Lucia offers universal healthcare through a public system, with several hospitals and wellness centers. Services are either free or heavily subsidized, though many citizens still turn to the private sector for faster or more comprehensive care. Challenges include outdated infrastructure and shortages of specialized professionals.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('VCT','This island nation is known for its stunning beaches, vibrant coral reefs, and active volcano, La Soufrière. It’s a popular destination for sailing and diving. Fun fact: The Grenadines are home to the world’s only known wild population of the Saint Vincent amazon parrot.','This country offers free or low-cost public healthcare to its citizens, with services concentrated in a few general hospitals and a network of health centers. While basic and emergency services are available, advanced care often requires overseas referrals, and the government collaborates with regional partners to support public health programs.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('WSM','Samoa is a Polynesian island nation with lush rainforests and beautiful beaches. It maintains strong traditional customs known as “fa’a Samoa” and is known for its welcoming culture. Fun fact: Samoa is one of the first places on Earth to greet the new day due to its position near the International Date Line.','Samoa operates a public healthcare system, with most services provided free of charge. Healthcare is centralized at the main hospital in Apia, but community health centers serve rural areas. Access to advanced treatments is limited, and overseas medical referrals (especially to New Zealand) are common for complex cases.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SMR','San Marino is a tiny, mountainous enclave surrounded by Italy, considered one of the world’s oldest republics, dating back to A.D. 301. Despite its size, it has its own government, currency, and unique traditions. It’s famous for its historic architecture and panoramic views. Fun fact: San Marino claims to be the world’s oldest surviving sovereign state and constitutional republic.','San Marino has a universal healthcare system managed by the state. Services are free or low-cost and include hospital, primary, and specialist care. The country’s small population allows for efficient health service delivery, and it often ranks well on European health indices. San Marino also has agreements with Italy for specialized treatment when necessary.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('STP','São Tomé and Príncipe is a tiny island nation in the Gulf of Guinea with a Portuguese colonial past. It''s a paradise of rainforests, volcanic peaks, and unspoiled beaches. The country is rich in endemic plant and bird species. Fun fact: São Tomé is one of the few places on Earth where you can stand near the equator and watch turtles lay eggs on the beach during nesting season.','São Tomé and Príncipe provides public healthcare services that are free or subsidized, but access is hampered by limited resources, outdated equipment, and staff shortages. The government works with international partners to improve healthcare infrastructure and delivery, particularly in maternal health and infectious disease prevention.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SAU','Saudi Arabia is the heartland of Islam, home to the two holiest cities—Mecca and Medina. It’s a land of contrasts: vast deserts like the Rub'' al Khali, ultramodern cities like Riyadh, and ancient sites like AlUla. Historically conservative, Saudi Arabia is undergoing significant social and economic reforms under its Vision 2030 initiative. Fun fact: Every year, millions of Muslims participate in the Hajj pilgrimage to Mecca, making it one of the largest annual human gatherings on Earth.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: middle Eastern Gulf states with extensive public healthcare complemented by private hospitals and clinics.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SEN','Senegal lies on the westernmost tip of Africa and is a vibrant hub of culture, music, and history. The country is known for its democratic stability, rich traditions like the Sabar drum, and coastal cities like Dakar. Senegalese hospitality, or "teranga," is a point of national pride. Fun fact: Senegal is home to Gorée Island, a UNESCO World Heritage Site and a haunting reminder of the Atlantic slave trade, featuring the House of Slaves and its "Door of No Return."','Senegal has a public healthcare system supported by a growing health insurance sector. Basic care is subsidized, and community health programs have improved access in rural areas. Still, many citizens face out-of-pocket expenses, and the government is working toward expanding universal health coverage and improving maternal and child health.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SRB','Serbia is a Balkan country known for its vibrant capital Belgrade, rich history, and cultural festivals. It has a mix of Eastern and Western influences, with beautiful Orthodox monasteries and lively nightlife. Serbia is also known for its traditional music and cuisine. Fun fact: Serbia hosts the EXIT music festival, one of Europe’s largest and most popular music events.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: transitional Eastern European nations with universal or near-universal coverage financed by public/social health insurance.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SYC','Seychelles is an archipelago of 115 islands in the Indian Ocean, famed for its white-sand beaches, granite boulders, and lush rainforests. It has a small population but incredible biodiversity, including rare species found nowhere else. Fun fact: The coco de mer palm, native to Seychelles, produces the world’s heaviest and most suggestively shaped seed—it can weigh up to 30 kg (66 lbs)!','Seychelles has a universal healthcare system with free healthcare for all citizens. Services are mainly provided by the government and include hospitals, polyclinics, and health centers across the islands. The country maintains a high standard of care relative to the region, with low maternal and infant mortality rates.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SLE','Sierra Leone is a West African country known for its lush landscapes, rich diamond deposits, and resilient people. Its capital, Freetown, was founded as a settlement for freed slaves. The country has made a strong recovery from civil war and Ebola outbreaks. Fun fact: Sierra Leone is home to Tacugama Chimpanzee Sanctuary, a leading conservation center that rescues and rehabilitates orphaned and endangered chimpanzees.','Developing-Nation Public Systems with Aid Support - characterized by limited coverage capacity, heavy donor/NGO involvement, and varying quality: these countries focus on essential services (maternal/child health, infectious disease), with limited infrastructure and geographical disparities.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SGP','Singapore is a tiny island city-state off the southern tip of Malaysia, celebrated for its orderliness, cleanliness, and efficient governance. It''s a global financial hub with a rich multicultural society influenced by Chinese, Malay, Indian, and Western traditions. Gardens by the Bay, Marina Bay Sands, and its incredible food hawker centers are world-famous. Fun fact: Despite its small size, Singapore is known as a “City in a Garden,” with over 50% of its land area covered by greenery, including rooftop gardens and vertical forests.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: typically tax-based or social insurance-funded universal systems that prioritize accessibility and quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SVK','Slovakia is a landlocked country with stunning natural scenery, including the High Tatras mountains, castles, and caves. Bratislava, its capital, blends modern life with historical sites. The country has a strong folk culture and traditions in music and dance. Fun fact: Slovakia is home to the largest castle complex in Central Europe, Spiš Castle.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: transitional Eastern European nations with universal or near-universal coverage financed by public/social health insurance.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SVN','Slovenia is a green and mountainous country known for its lakes, caves, and charming capital Ljubljana. It boasts a mix of Alpine and Mediterranean climates and is a great destination for outdoor activities like hiking and skiing. Fun fact: Slovenia’s Postojna Cave is one of the world’s largest karst cave systems and a popular tourist attraction.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: transitional Eastern European nations with universal or near-universal coverage financed by public/social health insurance.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SLB','The Solomon Islands are a group of islands in the South Pacific, rich in WWII history and biodiversity. The islands have many unique species and traditional cultures. Fun fact: The Solomon Islands are named after the biblical King Solomon because of their rumored riches.','Solomon Islands provides free basic healthcare through a decentralized public system. Services are concentrated in the National Referral Hospital and a network of rural clinics. Geographic isolation and underfunding challenge access and quality. The government partners with international agencies to improve maternal health and communicable disease control.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SOM','Somalia, located on the Horn of Africa, boasts the longest coastline in mainland Africa. Despite enduring decades of conflict, it retains a rich cultural heritage grounded in poetry, camel herding, and Islamic tradition. Fun fact: The ancient port city of Mogadishu was once a major trade center in the Indian Ocean, frequented by Arab, Persian, and Chinese merchants as early as the 10th century.','Developing-Nation Public Systems with Aid Support - characterized by limited coverage capacity, heavy donor/NGO involvement, and varying quality: these countries focus on essential services (maternal/child health, infectious disease), with limited infrastructure and geographical disparities.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ZAF','South Africa is a country of stunning contrasts—from the savannas of Kruger National Park to cosmopolitan Cape Town, and from the Drakensberg Mountains to vibrant townships. Known as the "Rainbow Nation," it celebrates a rich blend of cultures, languages, and histories. Fun fact: South Africa has three capital cities: Pretoria (executive), Bloemfontein (judicial), and Cape Town (legislative)—a unique arrangement reflecting its complex political past.','South Africa operates a two-tiered healthcare system: a public sector offering free or low-cost care to most of the population and a private sector that provides high-quality care to those who can afford insurance. Public facilities often struggle with overcrowding and underfunding, but the government is rolling out National Health Insurance (NHI) to move toward universal coverage.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('KOR','South Korea is a dynamic and technologically advanced country, known for its booming economy, pop culture exports (like K-pop and Korean dramas), and a deep-rooted Confucian heritage. Seoul, its capital, is a global innovation hub, blending tradition with hyper-modern life. Fun fact: South Korea has one of the fastest internet speeds in the world and leads in global smartphone usage and innovation.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries provide strong universal healthcare through public funding or insurance: mandatory health insurance systems complement public provider networks, ensuring near-universal access with private-sector options.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SSD','South Sudan is the world’s youngest country, gaining independence from Sudan in 2011. Despite facing numerous challenges, it has a culturally diverse population and beautiful landscapes like the Sudd, one of the world’s largest wetlands. Fun fact: South Sudan is home to one of the largest wildlife migrations on Earth, with millions of antelope moving across the plains—rivaling the Serengeti.','Socialized or Strong Primary Care-Centered Models - typically government-run systems emphasizing community-level care: state-run systems providing universal primary care; higher-level or specialized services often accessed abroad.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ESP','Spain is famous for its diverse regions, historic cities like Barcelona and Madrid, flamenco music, and delicious tapas. It has beautiful coastlines along the Mediterranean and Atlantic oceans. Spanish culture is vibrant, with festivals like La Tomatina and Running of the Bulls. Fun fact: Spain is home to the world’s largest tomato fight festival, La Tomatina, held annually in Buñol.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries provide strong universal healthcare through public funding or insurance: operate taxpayer or social insurance-funded universal systems.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('LKA','Sri Lanka is an island nation in the Indian Ocean known for its lush landscapes, ancient ruins, and vibrant biodiversity. With a history that dates back thousands of years, it is home to historic kingdoms, colonial forts, and sacred Buddhist sites like the Temple of the Tooth in Kandy. The country offers everything from serene beaches to misty highlands covered in tea plantations. Fun fact: Sri Lanka is where cinnamon was first discovered, and it was once the world’s main exporter of the spice, prized for centuries in ancient trade routes.','Transitional / Complex or Fragmented Systems - these countries exhibit a mix of public, private, and social-based coverage with varying degrees of access and equity: often have national health insurance or strong private role, still working on universalization and system reform.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SDN','Sudan, once Africa’s largest country before the secession of South Sudan, is a land of ancient civilizations. It features more pyramids than Egypt, particularly in the ancient kingdom of Kush. The Nile River runs through its heart, sustaining life in the desert. Fun fact: Sudan has over 200 pyramids, many clustered in the ancient city of Meroë, making it home to the largest number of pyramids in the world.','Emerging Public Systems, Aid-Supported - struggling systems with limited infrastructure, often dependent on humanitarian or donor support: public healthcare delivers basic and emergency care despite resource limitations and conflict-related challenges.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SUR','Suriname, the smallest country in South America, is known for its tropical rainforests, diverse culture, and Dutch colonial history. It has a rich mix of ethnic groups including indigenous peoples, Africans, Indians, and Javanese. Fun fact: Suriname is the only country in South America where Dutch is the official language.','Emerging Public Systems, Aid-Supported - struggling systems with limited infrastructure, often dependent on humanitarian or donor support: small or non-recognized regions reliant on parent-state systems or nearby nations, often delivering limited primary care.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SWZ','Formerly known as Swaziland, Eswatini is a small kingdom bordered by South Africa and Mozambique. It retains strong traditions and is one of the few remaining absolute monarchies in the world. It’s known for its stunning mountain scenery and vibrant cultural festivals. Fun fact: Eswatini hosts the annual Umhlanga Reed Dance, one of Africa’s most famous cultural events, where thousands of women dance before the king and the nation.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: public systems with rising national insurance schemes, often supplemented by private providers.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SWE','Sweden is known for its high quality of life, stunning natural landscapes, and innovative cities like Stockholm. It has a rich Viking history and a strong tradition in design and technology. Sweden is famous for its social welfare system and environmental consciousness. Fun fact: Sweden is home to the Icehotel, the world’s first hotel made entirely of ice and snow.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries offer comprehensive, government-backed health services with strong infrastructure and high quality: typically tax-based or social insurance-funded universal systems that prioritize accessibility and quality.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('CHE','Switzerland is renowned for its picturesque Alps, precision watchmaking, and banking sector. It’s a neutral country with multiple official languages and a high standard of living. Cities like Zurich and Geneva are cultural and financial hubs. Fun fact: Switzerland invented the red cross symbol, which was designed based on its flag.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries provide strong universal healthcare through public funding or insurance: operate taxpayer or social insurance-funded universal systems.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('SYR','Syria, located at the crossroads of the Middle East, has a rich and complex history that includes ancient civilizations like the Assyrians, Babylonians, and Romans. Despite recent conflict, it remains home to cultural treasures like the ancient city of Palmyra and the Umayyad Mosque in Damascus, one of the oldest continually inhabited cities in the world. Fun fact: The capital city, Damascus, is widely believed to be the oldest continuously inhabited capital city in the world, with evidence of settlement over 11,000 years old.','Emerging Public Systems, Aid-Supported - struggling systems with limited infrastructure, often dependent on humanitarian or donor support: public healthcare delivers basic and emergency care despite resource limitations and conflict-related challenges.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('TWN','Taiwan is a democratic island nation known for its high-tech industry, stunning mountains, night markets, and rich blend of traditional Chinese and modern Asian cultures. Taipei, the capital, features the iconic Taipei 101 skyscraper and some of Asia’s best street food. Taiwan also has a growing reputation for environmental sustainability and creative industries. Fun fact: Taiwan is home to the world’s first transparent sky gondola, the Maokong Gondola, offering breathtaking views of mountains, temples, and tea plantations.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries provide strong universal healthcare through public funding or insurance: mandatory health insurance systems complement public provider networks, ensuring near-universal access with private-sector options.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('TJK','Tajikistan is a mountainous country in Central Asia, dominated by the towering Pamir Mountains, sometimes called the “Roof of the World.” Its natural beauty includes glacial lakes, high-altitude passes, and deep valleys. Tajik culture is deeply rooted in Persian traditions, with a history tied to the Silk Road. Fun fact: Over 90% of Tajikistan is mountainous, and it boasts some of the highest peaks in the former Soviet Union, including Ismoil Somoni Peak (7,495 meters).','Transitional / Support-Mixed Systems - countries with complex mixes of public, private, and social-insurance components: heavy public system presence with layered private insurance, undergoing reform and decentralization.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('TZA','Tanzania is home to some of Africa’s most iconic landscapes and wildlife, from Mount Kilimanjaro to Serengeti National Park and the Ngorongoro Crater. It’s also where the Swahili coast meets the Indian Ocean, blending African, Arab, and European influences. Fun fact: The island of Zanzibar, part of Tanzania, was once the world''s largest producer of cloves and an important center of the spice and slave trade.','Mixed Public-Private Models with Universal Coverage - these countries offer basic public coverage alongside private options: public systems with insurance pilots and donor support covering essential services, with private-sector supplementation.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('THA','Thailand is a Southeast Asian country known for its tropical beaches, ornate temples, delicious cuisine, and warm hospitality. Bangkok, the bustling capital, contrasts with tranquil countryside and historic sites like Ayutthaya and Sukhothai. The country’s cultural identity is closely tied to Theravada Buddhism, which influences much of daily life. Fun fact: Thailand is home to Wat Pho, a temple complex in Bangkok that houses the largest collection of Buddha images in Thailand and is the birthplace of traditional Thai massage.','Mixed Public-Private Models with Universal Coverage - these countries offer basic public coverage alongside private options: public systems provide core services with expanding insurance, while private clinics offer speed and luxury.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('TGO','Togo is a narrow West African country known for its palm-lined beaches, rolling hills, and lively markets. Despite its small size, Togo boasts a diversity of ethnic groups and languages, as well as vibrant traditional religions and ceremonies.. Fun fact: Lomé, the capital of Togo, is home to the Akodessewa Fetish Market—the largest voodoo market in the world, offering everything from animal skulls to herbal remedies.','Togo’s healthcare system is publicly funded but limited in resources. The government provides low-cost services through hospitals and health centers, especially for primary care and vaccinations. However, there are significant disparities between urban and rural access, and shortages of medical professionals, equipment, and medicines remain persistent. International aid and NGOs play a major role in supporting public health, particularly in maternal and child health, malaria prevention, and HIV treatment. The government has been working to improve health insurance coverage through a national health insurance initiative, though implementation is still in progress.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('TON','Tonga is a Polynesian kingdom known for its coral reefs, whale watching, and strong monarchical traditions. It’s one of the few remaining monarchies in the Pacific. Fun fact: Tonga is the only Pacific nation never to have been formally colonized.','Special Territory Linked to Parent Nations - healthcare is administered by or tied to a larger nation''s healthcare systems (regional systems with basic public provision).');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('TTO','Trinidad and Tobago is a twin-island nation with a vibrant carnival culture, diverse wildlife, and rich musical traditions including calypso and soca. Trinidad is known for its oil industry, while Tobago offers pristine beaches. Fun fact: Trinidad is the birthplace of the steelpan, the only acoustic musical instrument invented in the 20th century.','Socialized or Strong Primary Care-Centered Models - typically government-run systems emphasizing community-level care: state-run systems providing universal primary care; higher-level or specialized services often accessed abroad.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('TUN','Tunisia is a North African country known for its Mediterranean coastline, rich history, and blend of Arab, Berber, and French influences. It was the heart of the ancient Carthaginian civilization and later a major Roman province. Today, Tunisia offers vibrant souks, Roman ruins, and beautiful beaches. Fun fact: The ancient city of Carthage near Tunis was one of the most powerful cities of the ancient world and is famous for its rivalry with Rome during the Punic Wars.','Mixed Public-Private Universal Coverage - these countries offer universal basic coverage plus optional private insurance or top-up services: public coverage is strong and expanding, with private sectors catering to those seeking faster access or specialist services.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('TUR','Turkey straddles both Asia and Europe, serving as a bridge between East and West. Its diverse heritage includes Greek, Roman, Byzantine, and Ottoman influences, seen in sites like Hagia Sophia, Ephesus, and Cappadocia. Istanbul, once known as Constantinople, remains a vibrant cultural and historical hub. Fun fact: The city of Istanbul is the only major city in the world located on two continents—Asia and Europe—divided by the Bosphorus Strait.','Mixed Public-Private Models with Universal Coverage - these countries offer basic public coverage alongside private options: public systems provide core services with expanding insurance, while private clinics offer speed and luxury.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('TKM','Turkmenistan is a largely desert-covered country in Central Asia, known for its vast Karakum Desert and ancient Silk Road cities like Merv. Its capital, Ashgabat, is noted for its grandiose white marble buildings and futuristic architecture. The country maintains a unique blend of traditional nomadic culture and strong state symbolism. Fun fact: Turkmenistan is home to the “Door to Hell”, a fiery natural gas crater in the Karakum Desert that has been burning continuously since 1971!','Turkmenistan operates a state-run healthcare system that nominally provides free medical care to citizens. The country has invested in modern hospital infrastructure, especially in urban areas, and promotes traditional medicine alongside modern practices. However, there are widespread concerns about transparency, access, and quality, especially in rural regions. Access to medications can be limited, and some services, while officially free, may require under-the-table payments. Recent reforms have aimed at improving primary care, maternal health, and medical education.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('TUV','Tuvalu is one of the world’s smallest and least populous countries, made up of tiny atolls in the Pacific. It faces significant risks from climate change and rising sea levels. Fun fact: Tuvalu’s national anthem is one of the shortest anthems in the world.','Socialized or Strong Primary Care-Centered Models - systems emphasize universal primary and family care, often state-run: mainly government-funded frontline care; complex cases often referred overseas.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('UGA','Uganda, often called the "Pearl of Africa," is famous for its stunning landscapes, including Lake Victoria and the Rwenzori Mountains. It’s home to rare mountain gorillas and a rich cultural mosaic of over 50 ethnic groups. Uganda’s diverse wildlife and warm people make it a unique travel destination. Fun fact: Uganda is one of the few places where you can see endangered mountain gorillas in their natural habitat, especially in Bwindi Impenetrable Forest.','Mixed Public-Private Models with Universal Coverage - these countries offer basic public coverage alongside private options: public systems with insurance pilots and donor support covering essential services, with private-sector supplementation.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('UKR','Ukraine is the largest country entirely in Europe, known for its fertile plains, historic cities like Kyiv, and rich cultural heritage. It has a strong agricultural base and is famous for folk traditions and crafts. Ukraine has faced significant geopolitical challenges in recent years. Fun fact: The Chernobyl disaster site, near Kyiv, has become a unique dark tourism destination.','Ukraine is undergoing major healthcare reform. Historically, the system was fully state-run and offered free services, but underfunding led to poor quality and widespread corruption. Recent reforms have introduced state-guaranteed health services, eHealth digitalization, and family doctor-based primary care. Citizens can now choose their providers, and certain core services are funded by the National Health Service of Ukraine (NHSU). Challenges remain due to the war, which has severely disrupted care access in conflict areas and increased the burden on the system. However, reforms continue despite the crisis.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ARE','The UAE is a federation of seven emirates, including Dubai and Abu Dhabi, known for their ultramodern cities, luxury tourism, and futuristic skyscrapers like the Burj Khalifa. Despite rapid modernization, the country preserves aspects of its Bedouin heritage, such as falconry, camel racing, and desert hospitality. Fun fact: The Burj Khalifa in Dubai is the tallest building in the world, standing at a staggering 828 meters (2,717 feet) tall.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries provide strong universal healthcare through public funding or insurance: mandatory health insurance systems complement public provider networks, ensuring near-universal access with private-sector options.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('GBR','The UK is a union of England, Scotland, Wales, and Northern Ireland with a rich history, influential culture, and global impact. London is a major financial and cultural capital, while the country is famous for its literature, music, and historic landmarks. Fun fact: The UK gave birth to iconic cultural phenomena like The Beatles and Shakespearean theatre.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries provide strong universal healthcare through public funding or insurance: operate taxpayer or social insurance-funded universal systems.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('USA','The United States is a large and diverse country known for its cultural influence, economic power, and natural wonders ranging from the Grand Canyon to the Everglades. It is a melting pot of cultures with a strong innovation and entertainment industry. Fun fact: The USA is home to the world’s first national park, Yellowstone, established in 1872.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries provide strong universal healthcare through public funding or insurance: combines limited public coverage (Medicare, Medicaid) with private insurance.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('URY','Uruguay is known for its stable democracy, progressive policies, and beautiful Atlantic coast beaches. Montevideo, the capital, combines European architecture with a relaxed vibe. The country is a major exporter of beef and has a strong gaucho (cowboy) culture. Fun fact: Uruguay was the first country to legalize marijuana nationwide in 2013.','Universal Coverage - High-Income / Social Insurance or Tax-Funded Sysrems - These countries provide strong universal healthcare through public funding or insurance: operate taxpayer or social insurance-funded universal systems.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('UZB','Uzbekistan is a landlocked nation in Central Asia rich in Silk Road history. Its cities—Samarkand, Bukhara, and Khiva—are architectural gems, with vibrant mosques, madrasahs, and bazaars. The country is known for its deep cultural traditions, handicrafts, and hearty cuisine like plov (rice pilaf). Fun fact: Uzbekistan is one of only two double-landlocked countries in the world, meaning it''s surrounded entirely by other landlocked nations (the other is Liechtenstein).','Transitional / Complex or Fragmented Systems - these countries exhibit a mix of public, private, and social-based coverage with varying degrees of access and equity: often have national health insurance or strong private role, still working on universalization and system reform.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('VUT','Vanuatu is an archipelago known for active volcanoes, diverse cultures, and vibrant marine life. It’s a favorite spot for eco-tourists and adventure seekers. Fun fact: Vanuatu has one of the highest linguistic densities per capita in the world, with over 100 indigenous languages.','Vanuatu provides universal healthcare primarily through the public system, offering basic services at little or no cost. Facilities include hospitals on the main islands and health centers or dispensaries in more remote areas. However, geographic dispersion and infrastructure limitations pose challenges to consistent access, especially for outer islands. The government, supported by international partners like Australia and WHO, focuses on maternal health, immunization, and infectious disease control. For advanced care, patients are often referred to New Caledonia or Australia.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('VAT','Vatican City is the smallest independent state in the world, located entirely within Rome. It is the spiritual and administrative center of the Roman Catholic Church and the residence of the Pope. The Vatican is home to incredible art treasures, including the Sistine Chapel. Fun fact: Vatican City has its own postal system, radio station, and even a small army called the Swiss Guard.','Special Territory Linked to Parent Nations - healthcare is administered by or tied to a larger nation''s healthcare systems (health depends on Italy and Vatican-specific arrangements).');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('VEN','Venezuela boasts spectacular natural beauty, including Angel Falls, the world’s highest uninterrupted waterfall. It has vast oil reserves and a vibrant cultural scene with influences from indigenous, African, and European roots. Fun fact: Angel Falls plunges over 3,200 feet (979 meters), taller than any other waterfall on the planet.','Mixed Public-Private Models with Universal Coverage - these countries offer basic public coverage alongside private options: public systems provide core services with expanding insurance, while private clinics offer speed and luxury.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('VNM','Vietnam is a Southeast Asian country known for its stunning landscapes, from lush rice terraces in the north to the dramatic karst formations of Ha Long Bay. Its rich history includes influences from Chinese, French, and American cultures, reflected in its cuisine, architecture, and traditions. The bustling cities of Hanoi and Ho Chi Minh City blend modern energy with centuries-old heritage. Fun fact: Vietnam is the world’s largest exporter of cashew nuts and also one of the top producers of coffee!','Mixed Public-Private Models with Universal Coverage - these countries offer basic public coverage alongside private options: public systems provide core services with expanding insurance, while private clinics offer speed and luxury.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('YEM','Located at the southern tip of the Arabian Peninsula, Yemen has a long and rich history, once home to powerful ancient kingdoms like Saba (Sheba). It features striking architecture, especially in cities like Sana''a, and diverse landscapes from deserts to mountains. Unfortunately, Yemen has been in the midst of a severe humanitarian crisis due to ongoing conflict. Fun fact: Yemen’s Socotra Island is often called the "Galápagos of the Indian Ocean" for its unique and otherworldly biodiversity—one-third of its plant species are found nowhere else on Earth.','Developing-Nation Public Systems with Aid Support - characterized by limited coverage capacity, heavy donor/NGO involvement, and varying quality: these countries focus on essential services (maternal/child health, infectious disease), with limited infrastructure and geographical disparities.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ZMB','Zambia is known for its incredible natural wonders, particularly Victoria Falls, one of the largest and most spectacular waterfalls on Earth. The country features vast savannas, rich wildlife, and friendly communities with a strong tradition of storytelling and music.Fun fact: Victoria Falls, shared with Zimbabwe, is locally called "Mosi-oa-Tunya," meaning "The Smoke That Thunders," due to the mist and roar created by the falls.','Mixed Public-Private Models with Universal Coverage - these countries offer basic public coverage alongside private options: public systems with insurance pilots and donor support covering essential services, with private-sector supplementation.');
INSERT INTO CountryInfo(countryCode,generalInfo,healthcareInfo) VALUES ('ZWE','Zimbabwe is a landlocked country famed for its dramatic landscapes, including the majestic Victoria Falls and ancient ruins like Great Zimbabwe, which gave the country its name. It’s rich in culture and has one of Africa’s most diverse ecosystems, supporting abundant wildlife. Fun fact: Great Zimbabwe is the largest ancient stone structure in sub-Saharan Africa and was the capital of the Kingdom of Zimbabwe during the Late Iron Age.','Mixed Public-Private Models with Universal Coverage - these countries offer basic public coverage alongside private options: public systems with insurance pilots and donor support covering essential services, with private-sector supplementation.');
